104.body:
🤓 Tato sekce obsahuje doplňující učivo. Pokud je toho na vás moc, můžete ji prozatím přeskočit a vrátit se k ní později. Občas se nám může hodit vytvořit výraz, který bude mít hodnotu jednoho ze dvou konkrétních výrazů, v závislosti na hodnotě nějaké podmínky. Například pokud bychom chtěli přiřadit minimum ze dvou hodnot do proměnné, tak to můžeme napsat takto: int a = 1;
int b = 5; int c = 0;
if (a < b) { c = a;
} else { c = b;
} Všimněte si, že do proměnné c ukládáme buď výraz a nebo výraz b, v závislosti na tom, jaká je hodnota podmínky a < b. Jelikož je tato situace relativně častá, a její vyřešení pomocí příkazu if je relativně zdlouhavé, tak jazyk C obsahuje zkratku v podobě ternárního operátoru ( ternary operator ). Tento výraz má následující syntaxi: <výraz X typu bool> ? <výraz A> : <výraz B> Pokud je výraz X pravdivý, tak se ternární operátor vyhodnotí jako hodnota výrazu A, v opačném případě se vyhodnotí jako hodnota výrazu B. Uhodnete, co vypíše následující program? #include <stdio.h> int main() { int a = 1; int b = 5; int c = (a >= b) ? a - b : a + b; printf("%d\n", c); return 0;
}

105.body:
Ve svých programech budete často chtít provádět nějakou operaci opakovaně, například: Pro každý záznam v databázi vypiš řádek do souboru. Pošli zprávu každému účastníkovi chatu. Načítej řádky ze souboru, dokud nedojdeš na konec souboru. Pokud bychom vždy pouze přidávali nové příkazy pod sebe, tak, jak to zatím známe, abychom nějaký příkaz provedli vícekrát, tak by naše programy jednak byly nejspíše dost dlouhé. Nejspíše bychom bychom neustále kopírovali ("copy-pastovali") velmi podobný kód: printf("0\n");
printf("1\n");
printf("2\n");
... což by vedlo k nepřehledným programům [1] . Pokud bychom navíc našli v programu chybu, museli bychom ji opravit na všech místech, kam jsme kód zkopírovali. Představte si, že chcete na výstup programu nebo do souboru vypsat třeba tisíc různých řádků textu. Ani s kopírováním kódu bychom si však nevystačili, pokud bychom potřebovali provádět kód opakovaně v závislosti na vstupu programu. Představte si situaci, kdy nám uživatel na vstup programu zadá číslo, kolikrát má náš program vypsat nějaký řádek textu na výstup. Uživatel se při každém spuštění programu může rozhodnout pro jiné číslo, 0, 1, 42, 1000. Program však zůstává stále stejný - už při tvorbě (psaní) programu se musíme rozhodnout, kolik příkazů pro výpis do něj vložíme. Poté se program přeloží na spustitelný soubor a poté už naši volbu nemůžeme jednoduše změnit. Takovýto program bychom tedy zatím (pouze pomocí proměnných a podmínek) neměli jak naprogramovat. Proto programovací jazyky nabízí tzv. cykly ( loops ), pomocí kterých můžeme jednoduše říct počítači, aby určitý blok kódu opakoval, kolikrát budeme chtít. Díky tomu může program i s pouze několika málo řádky kódu říct počítači, aby provedl spoustu instrukcí. Jazyk C nabízí dva základní typy cyklů, while a for . Další motivací pro využití cyklů je to, že moderní procesory počítačů mají běžně frekvence od 1 do 4 GHz, takže za vteřinu zvládnou provést několik miliard taktů a během každého taktu navíc až desítky různých operací. Jistě si dovedete představit, že s pouze sekvenčním zápisem kódu bychom tento potenciál nemohli naplno využít. I když jeden řádek C kódu může být přeložen až na desítky procesorových instrukcí, tak i kdybychom zvládli napsat program se stovkami milionů řádek, pořád bychom takovýmto programem "zabavili" procesor na pouhou vteřinu. Běžící programy tak obvykle tráví většinu času právě prováděním nějakého cyklu.

106.body:
Nejjednodušším cyklem v C je cyklus while ("dokud"): while (<výraz typu bool>) { // blok cyklu
} Funguje následovně: Nejprve se vyhodnotí (Booleovský) výraz v závorce za while a provede se bod 2. Pokud: Je výraz pravdivý, tak se provede blok [1] cyklu a dále se pokračuje opět bodem 1. Není výraz pravdivý, tak se provede bod 3. Program pokračuje za cyklem while. Blok cyklu se také často nazývá jako tělo ( body ) cyklu. Jinak řečeno, dokud bude splněná podmínka za while, tak se budou opakovaně provádět příkazy uvnitř těla cyklu. Vyzkoušejte si to na následujícím příkladu: #include <stdio.h> int main() { int pocet = 0; while (pocet < 5) { printf("Telo cyklu se provedlo, hodnota promenne pocet=%d\n", pocet); pocet = pocet + 1; } return 0;
} Tento kód opět můžeme přečíst jako větu: Dokud je hodnota proměnné pocet menší než pět, prováděj tělo cyklu. Jedno vykonání těla cyklu se nazývá iterace . Cyklus v ukázce výše tedy provede pět iterací, protože se tělo cyklu provede pětkrát. Pokud výraz za while není vyhodnocen jako pravdivý v momentě, kdy se while začne vykonávat, tak se tělo cyklu nemusí provést ani jednou (tj. bude mít nula iterací).

109.body:
V cyklech můžete využít dva speciální příkazy, které fungují pouze uvnitř těla (bloku kódu) nějakého cyklu: Příkaz continue; způsobí, že se přestane vykonávat tělo cyklu, a program bude pokračovat ve vykonávání na začátku cyklu (tedy u while na vyhodnocení výrazu). continue lze chápat jako skok na další iteraci cyklu. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int pocet = 0; while (pocet < 10) { pocet = pocet + 1; if (pocet < 5) { continue; } printf("Hodnota: %d\n", pocet); } return 0;
} Příkaz break; způsobí, že se cyklus přestane vykonávat a program začne vykonávat kód, který následuje za cyklem. Cyklus se tak zcela přeruší. Zkuste uhodnout, co vypíše následující kód: #include <stdio.h> int main() { int pocet = 0; while (pocet < 10) { if (pocet * 2 > 12) { break; } printf("Hodnota: %d\n", pocet); pocet = pocet + 1; } return 0;
} Tip pro návrh cyklů while Příkaz break lze také někdy použít k usnadnění návrhu cyklů. Pokud potřebujete napsat while cyklus s nějakou složitou podmínkou ukončení, ze které se vám motá hlava, zkuste nejprve vytvořit "nekonečný" cyklus pomocí while (1) { … }, dále vytvořte tělo cyklu a až nakonec vymyslete podmínku, která cyklus ukončí pomocí příkazu break: #include <stdio.h> int main() { int pocet = 0; int pocet2 = 1; while (1) { printf("Hodnota: %d\n", pocet); pocet = pocet + 1; pocet2 += pocet * 2; if (pocet > 10) break; if (pocet2 > 64) break; } return 0;
} Nemusíte tak hned ze začátku vymýšlet výraz pro while, na čemž byste se mohli zaseknout. Místo while (1) můžete použít také while (true). Nezapomeňte ale na vložení řádku #include <stdbool.h> na začátek programu!

110.body:
Stejně jako podmínky, i cykly jsou příkazy, a můžete je tak používat libovolně v blocích C kódu a také je vnořovat . Chování vnořených cyklů může být ze začátku trochu neintuitivní, proto je dobré si je procvičit. Zkuste si pomocí debuggeru krokovat následující kód, abyste pochopili, jak se provádí, a zkuste odhadnout, jakých hodnot budou postupně nabývat proměnné i a j. Poté odkomentujte výpisy printf a ověřte, jestli byl váš odhad správný: #include <stdio.h> int main() { int i = 0; while (i < 3) { // printf("i: %d
", i); int j = 0; while (j < 4) { // printf(" j: %d
", j); j = j + 1; } i = i + 1; } printf("Konec programu
"); return 0;
} Pro každou iteraci "vnějšího" while cyklu se provedou čtyři iterace "vnitřního" while cyklu. Dohromady se tak provede celkem 3 * 4 iterací.

111.body:
Cyklus while má také alternativu zvanou do while. Tento cyklus má následující syntaxi: do { // tělo cyklu
}
while (<výraz typu bool>); Tento kód můžeme číst jako Prováděj <tělo cyklu>, dokud platí <výraz>. Jediný rozdíl mezi while a do while je ten, že v cyklu do while se výraz, který určuje, jestli se má provést další iterace cyklu, vyhodnocuje až na konci cyklu. Tělo cyklu tak bude pokaždé provedeno alespoň jednou (i kdyby byl výraz od začátku nepravdivý). Pokud pro to nemáte zvláštní důvod, asi není třeba tento typ cyklu používat. Kvíz 🤔 Co vypíše následující program? #include <stdio.h>
#include <stdbool.h> int main() { int a = 0; int b = 8; while (true) { if (a > 2) { printf("Hodnota a = %d\n", a); } a = a + 2; if (a >= b) { break; } } return 0;
} Odpověď Program vypíše: Hodnota a = 4
Hodnota a = 6 V každé iteraci cyklu se hodnota proměnné a zvýší o dvojku. Pokud je na začátku iterace hodnota a větší, než dva, tak se vypíše její hodnota. V čtvrté iteraci cyklu se hodnota proměnné a zvýší na osm. Poté se podmínka příkazu if vyhodnotí jako true, takže se provede příkaz break, který provádění cyklu ukončí. Hodnota proměnné a se tak vypíše pouze dvakrát. Co vypíše následující program? #include <stdio.h>
#include <stdbool.h> int main() { int a = 0; int b = 8; while (true) { if (a > 2) { printf("Hodnota a = %d\n", a); } if (a >= b) { break; } a = a + 2; } return 0;
} Odpověď Program vypíše: Hodnota a = 4
Hodnota a = 6
Hodnota a = 8 V každé iteraci cyklu se hodnota proměnné a zvýší o dvojku. Pokud je na začátku iterace hodnota a větší, než dva, tak se vypíše její hodnota. V páté iteraci cyklu je hodnota proměnné a osm, takže se cyklus ukončí příkazem break. Všimněte si rozdílu pořadí příkazu if a zvýšení hodnoty proměnné a v tomto a předchozím příkladu. Co vypíše následující program? #include <stdio.h> int main() { int a = 0; int b = 6; while (a > b) { printf("Hodnota b = %d\n", b); b = b + 1; } return 0;
} Odpověď Program nevypíše nic, protože podmínka a > b se vyhodnotí jako false. Tělo cyklu se tak neprovede ani jednou.

112.body:
V programech velmi často potřebujeme vykonat nějaký blok kódu přesně n-krát: Projdi n řádků ze vstupního souboru a sečti jejich hodnoty. Pošli zprávu všem n účastníkům chatu. Vystřel přesně třikrát ze zbraně. I když pomocí cyklu while můžeme vyjádřit provedení n iterací, je to relativně zdlouhavé, protože je k tomu potřeba alespoň tří řádků kódu: Inicializace cyklu: vytvoření řídící proměnné, která se bude kontrolovat v cyklu Kontrola výrazu: kontrola, jestli už řídící proměnná dosáhla požadované hodnoty Operace na konci cyklu: změna hodnoty řídící proměnné int i = 0; // inicializace řídící proměnné
while (i < 10) { // kontrola hodnoty řídící proměnné // tělo cyklu i += 1; // změna hodnoty řídící proměnné
} Cyklus for existuje, aby tuto častou situaci zjednodušil. Kód výše by se dal pomocí cyklu for přepsat takto: for (int i = 0; i < 10; i += 1) { // tělo cyklu
} Jak lze vidět, for cyklus v sobě kombinuje inicializaci cyklu, kontrolu výrazu a provedení příkazu po každé iteraci. Obecná syntaxe tohoto cyklu vypadá takto: for (<příkaz A>; <výraz typu bool>; <příkaz B>) { // tělo cyklu
} Takovýto cyklus se vykoná následovně: Jakmile se cyklus začne vykonávat, nejprve se provede příkaz A. Zde se typicky vytvoří řídící proměnná s nějakou počáteční hodnotou. Zkontroluje se výraz. Pokud není pravdivý, cyklus končí a program pokračuje za cyklem for. Pokud je pravdivý, provede se tělo cyklu a program pokračuje bodem 3. Provede se příkaz B a program pokračuje bodem 2. Výraz v příkazu for může chybět, v takovém případě se pokládá automaticky za true. Zároveň platí, že středníkem (;) lze vyjádřit tzv. prázdný příkaz , který nic neprovede. Všechny tři části cyklu for tak můžou chybět, v tom případě se pak jedná o nekonečný cyklus : for (;;) { ...
} Cvičení 🏋 Napište program, který pomocí cyklu for na výstup vypíše čísla od 0 do 9 (včetně). Vypište na výstup řádek Licha iterace v každé liché iteraci cyklu a řádek Suda iterace v každé sudé iteraci tohoto cyklu. Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { int a = 5; for (; a >= 0; a = a - 1) { printf("iterace %d\n", a); } printf("a = %d\n", a); return 0;
} Odpověď Program vypíše: iterace 5
iterace 4
iterace 3
iterace 2
iterace 1
iterace 0
a = -1 Při poslední iteraci cyklu se hodnota proměnné a zmenší z 0 na -1, poté už se podmínka cyklu vyhodnotí na false a cyklus skončí. Všimněte si, že definice a inicializace řídící proměnné je mimo cyklus, jinak bychom k této proměnné po ukončení provádění cyklu již neměli přístup. Definice řídící proměnné před cyklem se nám může občas hodit, pokud bychom s hodnotou řídící proměnné chtěli pracovat dále za cyklem (například abychom zjistili, kolik iterací cyklus provedl). Co vypíše následující program? #include <stdio.h> int main() { for (int a = 0; a <= 5; a = a + 1) { printf("iterace %d\n", a); if (a <= 2) { a = a + 1; } } return 0;
} Odpověď Program vypíše: iterace 0
iterace 2
iterace 4
iterace 5 Pokud je při provádění iterace cyklu hodnota a menší nebo rovno dvěma, tak se hodnota a v iteraci zvýší o jedničku dvakrát (jednou uvnitř příkazu if a jednou na konci iterace cyklu for). Co vypíše následující program? #include <stdio.h> int main() { for (int a = 0; a = 5; a = a + 1) { printf("iterace %d\n", a); } return 0;
} Odpověď Program bude neustále vypisovat hodnotu proměnné a, protože výraz a = 5 se vyhodnotí jako 5, a toto číslo se při převodu na bool vyhodnotí jako pravda (true), takže tento cyklus je nekonečný. Záměna přiřazení (=) a == (porovnání) je častou začátečnickou chybou .

113.body:
Zatím jsme veškerý kód psali pouze na jedno místo v programu, do "mainu" . Jakmile programy začnou být větší a větší, tak začne také být neustále těžší a těžší se v nich zorientovat a udržet je celé v hlavě, abychom nad nimi mohli přemýšlet. Zároveň se nám v programu brzy začnou objevovat úseky kódu, které jsou téměř totožné, ale liší se v drobných detailech. Chtěli bychom tak mít možnost takovýto kód napsat pouze jednou a tyto měnící se detaily do něj pouze "dosadit". K rozdělení kódu programu do sady ucelených částí a jejich parametrizaci slouží funkce ( functions ). Funkce je pojmenovaný blok kódu, na který se můžeme odkázat v jiné části programu a vykonat tak kód, který se ve funkci nachází. S jednou funkcí už jsme se setkali. Jedná se o funkci main, jejíž kód je proveden při spuštění programu. My si nicméně můžeme vytvořit vlastní funkce. Zde je příklad vytvoření, tj. definice ( definition ) jednoduché funkce s názvem [1] vypis_text: void vypis_text() { printf("Ahoj\n");
} Pravidla pro pojmenovávání funkcí jsou totožná s pravidly pro pojmenovávání proměnných . Před názvem funkce je nutné uvést datový typ (zde je uveden typ void). Níže bude vysvětleno, k čemu tento typ slouží. Tento blok [2] kódu se přeloží na instrukce a bude existovat v přeloženém programu stejně jako funkce main, nicméně sám o sobě se nezačne provádět. Abychom kód této funkce provedli, musíme ji tzv. zavolat ( call ). To provedeme tak, že napíšeme název této funkce a za něj dáme závorky (()): #include <stdio.h> void vypis_text() { printf("Ahoj\n");
}
int main() { vypis_text(); // zavolání funkce vypis_text return 0;
} Stejně jako u cyklů se bloku kódu funkce často říká tělo funkce ( function body ). Zavolání funkce je výraz, při jehož vyhodnocení dojde k provedení kódu funkce, která se volá. Když se v programu nahoře ve funkci main vykoná řádek vypis_text();, tak se začne vykonávat kód funkce vypis_text. Jakmile se příkazy z této funkce vykonají, tak program bude pokračovat ve funkci main. Pomocí volání funkcí můžeme mít kus kódu v programu zapsán pouze jednou ve funkci, a poté ho můžeme spouštět z různých částí programu, podle toho, kdy se nám to zrovna bude hodit. Funkce main je zavolána při spuštění programu, čímž dojde k tomu, že se začnou vykonávat její příkazy.

114.body:
Funkcím můžeme přiřadit vstupy zvané parametry ( parameters ). Parametry jsou proměnné dostupné uvnitř funkce, jejichž hodnotu nastavujeme při zavolání dané funkce. Například následující funkce vypis_cislo má parametr cislo s datovým typem int. #include <stdio.h> void vypis_cislo(int cislo) { printf("Cislo: %d\n", cislo);
}
int main() { vypis_cislo(5); return 0;
} Při zavolání funkce musíme pro každý její parametr do závorek dát hodnotu odpovídajícího datového typu. Zde je jediný parameter typu int, takže při zavolání této funkce musíme do závorek dát jednu hodnotu datového typu int: vypis_cislo(5). Před spuštěním příkazů ve funkci dojde k tomu, že se každý parametr nastaví na hodnotu předanou při volání funkce [3] . Při zavolání vypis_cislo(5) si tak můžete představit, že se vykoná následující kód: { // nastavení hodnot parametrů int cislo = 5; // tělo funkce printf("Cislo: %d\n", cislo); } Hodnoty (výrazy) předávané při volání funkce se nazývají argumenty ( arguments ). Při volání vypis_cislo(5) se tedy do parametru cislo nastaví hodnota argumentu 5. Je důležité si uvědomit, že při každém zavolání funkce můžeme použít různé hodnoty argumentů: #include <stdio.h> void vypis_cislo(int cislo) { printf("Cislo: %d\n", cislo); if (cislo < 0) { printf("Predane cislo je zaporne\n"); } else { printf("Predane cislo je nezaporne\n"); }
}
int main() { vypis_cislo(5); vypis_cislo(1 + 8); int x = -10; vypis_cislo(x); return 0;
} Parametrů mohou funkce brát libovolný počet, nicméně obvykle se používají jednotky (maximálně cca 5) parametrů, aby funkce a její používání (volání) nebylo příliš složité. Jednotlivé parametry jsou odděleny v definici funkce i v jejím volání čárkami: #include <stdio.h> void vypis_cisla(int a, int b) { printf("Cislo a: %d\n", a); printf("Cislo b: %d\n", b);
}
int main() { vypis_cisla(5 + 5, 11 * 2); return 0;
} Pomocí parametrů můžeme vytvořit kód, který není "zadrátovaný" na konkrétní hodnoty, ale umí pracovat s libovolnou hodnotou vstupu. Díky toho lze takovou funkci využít v různých situacích bez toho, abychom její kód museli kopírovat. Příklady použití parametrů funkcí: Funkci vypis_ctverec, která přijme jako parametr číslo n a vypíše na výstup čtverec tvořený znaky x o straně n. Funkci vykresli_pixel, která přijme jako parametry souřadnici na obrazovce a barvu a vykreslí na obrazovce na dané pozici pixel s odpovídající barvou. Cvičení 🏋 Zkuste naprogramovat funkci vypis_ctverec. Další zadání jednoduchých funkcí naleznete zde .

115.body:
Nejenom, že funkce mohou přijímat vstup, ale umí také vracet výstup. Datový typ uvedený před názvem funkce udává, jakého typu bude tzv. návratová hodnota ( return value ) dané funkce. V příkladech výše jsme viděli datový typ void. Tento datový typ je speciální, protože říká, že funkce nebude vracet nic . Pokud funkce má návratový typ void, tak nevrací žádnou hodnotu - pokud zavoláme takovouto funkci, tak se sice provede její kód, ale výraz zavolání nevrátí žádnou hodnotu: void funkce() {} int main() { // chyba při překladu, funkce nic nevrací int x = funkce(); return 0;
} Často bychom nicméně chtěli funkci, která přijme nějaké hodnoty (parametry), vypočte nějakou hodnotu a poté ji vrátí. Toho můžeme dosáhnout tak, že funkci dáme návratový typ jiný než void a poté ve funkci použijeme příkaz return <výraz>;. Při provedení tohoto výrazu se přestane funkce vykonávat a její volání se vyhodnotí hodnotou předaného výrazu. Zde je příklad funkce, která bere jako vstup jedno číslo a spočítá jeho třetí mocninu: #include <stdio.h> int treti_mocnina(int cislo) { return cislo * cislo * cislo;
}
int main() { printf("%d\n", treti_mocnina(5 + 1)); return 0;
} Jak probíhá vyhodnocování funkcí si můžete procvičit zde . Příkazů return může být ve funkci více: int absolutni_hodnota(int cislo) { if (cislo >= 0) { return cislo; } return -cislo;
} Nicméně je důležité si uvědomit, že po provedení příkazu return už funkce dále nebude pokračovat: int zvetsi(int cislo) { return cislo + 1; printf("Provadi se funkce zvetsi\n"); // tento řádek se nikdy neprovede
} Pokud má funkce jakýkoliv jiný návratový typ než void, tak v ní musí být vždy proveden příkaz return! Pokud k tomu nedojde, tak program může začít vykazovat nedefinované chování 💣 a může se tak chovat nepředvídatelně. Například následující funkce je špatně, protože pokud hodnota parametru cislo bude nezáporná, tak se ve funkci neprovede příkaz return: int absolutni_hodnota(int cislo) { if (cislo < 0) { return -cislo; }
} Pokud má funkce návratový typ void, tak její provádění můžeme ukončit pomocí příkazu return; (zde nepředáváme žádný výraz, protože funkce nic nevrací).

