119.body:
Možná vás napadlo, že název funkce zní podobně jako funkce v matematice. Není to náhoda, funkce v programech se tak opravdu dají částečně chápat – berou nějaký vstup (parametry) a vracejí výstup (návratovou hodnotu). Například následující matematickou funkci: \( f(x) = 2 * x \) můžeme v C naprogramovat takto: int f(int x) { return 2 * x;
} Aby ale funkce v C splňovala požadavky matematické funkce, musí být splněno několik podmínek: Funkce nesmí mít žádné vedlejší efekty . To znamená, že by měla pouze provést výpočet na základě vstupních parametrů a vrátit vypočtenou hodnotu. Neměla by číst ani modifikovat globální proměnné nebo například pracovat se soubory na disku či komunikovat po síti. Funkce musí mít návratový typ jiný než void, aby vracela nějakou hodnotu. Z toho také vyplývá, že funkce s návratovým typem void by měla mít nějaké vedlejší efekty, jinak by totiž nemělo smysl ji volat (protože nic nevrací). Pokud je funkce zavolána se stejnými hodnotami parametrů, musí vždy vrátit stejnou návratovou hodnotu. Této vlastnosti se říká idempotence . Jelikož jsou počítače deterministické, tato vlastnost by měla být triviálně splněna, pokud funkce neobsahuje žádné vedlejší efekty. Funkce splňující tyto vlastnosti se nazývají čisté ( pure ). S takovýmito funkcemi je jednodušší pracovat a přemýšlet nad tím, co dělají, protože si můžeme být jistí, že nemodifikují okolní stav programu a pouze spočítají výsledek v závislosti na svých parametrech. Pokud to tedy jde, snažte se funkce psát tímto stylem (samozřejmě ne vždy je to možné). V předmětu Funkcionální programování budete pracovat s funkcionálními programovacími jazyky, ve kterých je právě většina funkcí čistých. Kvíz 🤔 Co vypíše následující program? #include <stdio.h> void zmen_cislo(int cislo) { cislo = 5;
} int main() { int cislo = 8; zmen_cislo(cislo); printf("%d\n", cislo); return 0;
} Odpověď Program vypíše 8. Při volání zmen_cislo se uvnitř této funkce vytvoří nová lokální proměnná pro parametr cislo a uloží se do ní hodnota z odpovídajícího předaného argumentu. Změna hodnoty tohoto parametru uvnitř zmen_cislo nijak neovlivní proměnnou cislo uvnitř funkce main. Můžete si to představit tak, že se při zavolání této funkce provedl cca takovýto kód: { // nastavení parametru int cislo = 8; // kód funkce cislo = 5;
} To, že se zde parametr jmenuje stejně jako proměnná, kterou předáváme jako argument, nemá žádný speciální význam. Funkci jsme mohli klidně zavolat např. takto: zmen_cislo(1 + 9). Z toho je zřejmé, že změna hodnoty parametru nijak neovlivní předaný argument. Mimochodem, tím, že zmen_cislo nic nevrací a nemá žádný vedlejší efekt, tak v podstatě ani nemá žádný smysl. Je to pouze ukázka. Co vypíše následující program? #include <stdio.h> void vytvor_promennou() { int x = 5;
} int main() { vytvor_promennou(); printf("%d\n", x); return 0;
} Odpověď Tento program se nepřeloží, protože uvnitř funkce main neexistuje proměnná s názvem x. Lokální proměnné jsou dostupné pouze v rámci bloku , ve kterém byly nadefinovány. Proměnnou x tak lze použít pouze v kódu uvnitř funkce vytvor_promennou. Co vypíše následující program? #include <stdio.h> void vypis_soucet(int x) { int soucet = x + b; printf("%d\n", soucet);
} int main() { int a = 5; int b = 8; vypis_soucet(a); return 0;
} Odpověď Tento program se nepřeloží, protože uvnitř funkce vypis_soucet neexistuje proměnná s názvem b. Na řádku, kde funkci voláme, sice existuje proměnná b uvnitř funkce main, ale to s tím nijak nesouvisí - co kdybychom vypis_soucet volali z nějakého jiného místa programu, kde by žádná proměnná b neexistovala? Funkce má přístup pouze ke svým lokálním proměnným a parametrům (případně také ještě ke globálním proměnným). Pokud chceme nějakou hodnotu z jedné funkce použít v jiné funkci, musíme ji předat jako parametr: void vypis_soucet(int x, int b) { int soucet = x + b; printf("%d\n", soucet);
} int main() { int a = 5; int b = 8; vypis_soucet(a, b); return 0;
} Co vypíše následující program? #include <stdio.h> int vrat_cislo(int x) { return x;
} int main() { int cislo = 5; vrat_cislo(cislo) = 8; printf("%d\n", cislo); return 0;
} Odpověď Tento program se nepřeloží, protože se snažíme provést operaci přiřazení (=), ale na levé straně od rovnítka není místo v paměti (např. proměnná), do které bychom mohli hodnotu 8 zapsat. Volání funkce je výraz, který se vyhodnotí jako návratová hodnota, kterou tato funkce vrátí. Je to jako bychom napsali toto: 5 = 8; Což zřejmě nedává smysl, a proto se program nepřeloží. Co vypíše následující program? #include <stdio.h> int umocni(int x) { return x * x;
} int main() { int cislo = 5; umocni(cislo); printf("%d\n", cislo); return 0;
} Odpověď Program vypíše 5. Volání funkce umocni sice vrátí hodnotu 25, ale tato hodnota se okamžitě "zahodí", protože ji nikam neuložíme. Hodnota proměnné cislo se tak nezmění. Aby program vypsal 25, tak bychom museli návratovou hodnotu z volání funkce uložit zpět do proměnné cislo: cislo = umocni(cislo); Co vypíše následující program? #include <stdio.h> void vypis_cislo(int x) { if (x < 0) { return; } printf("cislo = %d\n", x);
} int main() { vypis_cislo(1); vypis_cislo(-1); return 0;
} Odpověď Program vypíše cislo = 1. Při volání vypis_cislo(-1) bude splněna podmínka uvnitř vypis_cislo, takže dojde k ukončení provádění funkce příkazem return; a nedojde tak k vypsání tohoto záporného čísla. Co vypíše následující program? #include <stdio.h> int vypocet(int x) { if (x > 5) { return x + 1; } return x * 2;
} int main() { int a = 6; int b = 4; int c = vypocet(vypocet(a) + vypocet(b)); printf("%d\n", c); return 0;
} Odpověď Program vypíše 16. Není zde žádná zrada :) Nejprve se vyhodnotí vypocet(a) na 7, poté vypocet(b) na 8, a poté se zavolá vypocet(7 + 8), který se vyhodnotí na 16. Vyhodnocování výrazů a volání funkcí si můžete procvičit zde . Co vypíše následující program? #include <stdio.h> int cislo = 1; void uprav_promennou() { cislo = 2;
} int main() { printf("%d\n", cislo); uprav_promennou(); printf("%d\n", cislo); return 0;
} Odpověď Program vypíše: 1
2 Jelikož je proměnná cislo globální, tak k ní mají přístup funkce uprav_promennou i main. Změna této proměnné ve funkci uprav_promennou se tedy promítne, když budeme číst hodnotu této proměnné ve funkci main.

