127.body:
🤓 Tato sekce obsahuje doplňující učivo. Pokud je toho na vás moc, můžete ji prozatím přeskočit a vrátit se k ní později. Občas můžeme chtít v programech použít stejnou hodnotu na více místech. V takovém případě se hodí danou hodnotu pojmenovat, aby bylo zřejmé, co reprezentuje. Zároveň by bylo užitečné ji nadefinovat pouze na jednom místě, abychom její hodnotu mohli jednoduše upravit bez toho, abychom při tom museli upravovat všechna místa, kde danou hodnotu používáme. Pomocí příkazu #define <název> <hodnota> můžeme vytvořit makro ( macro ) s daným názvem a hodnotou. Pokud preprocesor v kódu od řádku s #define do konce zdrojového souboru narazí na název makra, tak tento název nahradí hodnotou makra (opět se jedná o prosté textové nahrazení, tedy Ctrl+C -> Ctrl+V). Zkuste si například, co vypíše tento program: #include <stdio.h> #define CENA 25 int main() { printf("Cena je %d\n", CENA); printf("Dvojnasobek ceny je %d\n", CENA * 2); return 0;
} Představte si, že hodnotu tohoto makra používáme v programu na stovkách míst. Pokud bychom ji potřebovali změnit, tak stačí změnit jeden řádek s #define a preprocesor se poté postará o to, že se hodnota aktualizuje na všech použitých místech. Makra jsou dle konvence obvykle pojmenována s "caps-lockem", tedy velkými písmeny (respektive stylem screaming snake case ). Je třeba brát na vědomí, že preprocesor opravdu dělá pouhé textové nahrazení. Například následující kód tak nedává smysl: #define CENA 25
int main() { CENA = 0; return 0;
} protože po spuštění preprocesoru se z něj stane tento (nesmyslný) kód: int main() { 25 = 0; return 0;
}

128.body:
Makra mohou také obsahovat parametry: #define <název_makra>(<param1>, <param2>, …) <hodnota_makra> Tyto parametry můžete použít pro definici hodnoty. Nicméně je opět třeba dát pozor na to, že preprocesor pracuje pouze s textem, nerozumí jazyku C . Parametry tak jsou předávány čistě jako text, je tak potřeba dávat si pozor na několik věcí: Priorita operátorů Pokud bychom chtěli vytvořit například makro pro výpočet druhé mocniny, můžeme ho napsat takto: #define MOCNINA(a) a * a Pokud však takovéto makro použijeme s nějakým komplexním výrazem, nemusíme dosáhnout kýženého výsledku kvůli priority operátorů: #include <stdio.h> #define MOCNINA(a) a * a int main() { printf("%d
", MOCNINA(1 + 1)); return 0;
} Řádek s printf totiž preprocesor změní na printf("%d
", 1 + 1 * 1 + 1);, což jistě není to, co jsme chtěli. Proto je dobré při použití maker s parametry obalovat jednotlivé parametry závorkami: #define MOCNINA(a) (a) * (a) Pak by zde již došlo k úpravě na printf("%d
", (1 + 1) * (1 + 1));, což vrátí druhou mocninu výrazu 1 + 1, tedy 4. Vedlejší efekty Pokud mají argumenty předávané do makra nějaké vedlejší efekty , je třeba si dávat pozor na to, že makro může jednoduše takovýto argument rozkopírovat a tím pádem vedlejší efekt provést vícekrát. Například při použití makra MOCNINA výše by zde došlo k dvojnásobené inkrementaci proměnné x: #include <stdio.h> #define MOCNINA(a) a * a int main() { int x = 0; int mocnina = MOCNINA(x++); printf("x=%d, mocnina=%d
", x, mocnina); return 0;
} Do maker tak radši nedávejte argumenty, které způsobují vedlejší efekty.

133.body:
Zatím jsme používali (lokální) proměnné, které vznikají a zanikají uvnitř funkcí. Nemuseli jsme se tedy nijak starat o to, kde existují v paměti. Lokální proměnné se ukládají do oblasti v paměti, kterou nazýváme zásobník ( stack ). Každý běžící program má vyhrazen určitou oblast adresovatelné paměti, která je použita právě jako zásobník. Při každém zavolání funkce vznikne na zásobníku tzv. zásobníkový rámec ( stack frame ). V tomto rámci je vyhrazena (tzv. naalokována ) paměť pro lokální proměnné volané funkce a také pro její parametry . Rámec vzniká při každém zavolání funkce, v jednu chvíli tak na zásobníku může existovat více rámců (s různými hodnotami proměnných a parametrů) pro stejnou funkci. Rámce vznikají v paměti za sebou, a jsou uvolněny v momentě, kdy se jejich funkce dokončí. [1] Rámce tak mohou vznikat nebo zanikat pouze na konci zásobníku, ne uprostřed. Proto se tato oblast nazývá zásobník, podle datové struktury , která má tuto vlastnost. Při zavolání funkce se do paměti určené pro jednotlivé parametry v rámci nakopírují hodnoty předaných argumentů. Jakmile funkce skončí, tak je rámec, a tedy i paměť obsahující lokální proměnné a parametry dané funkce, uvolněn [2] . Uvolnění zde znamená pouze to, že program bude pokládat danou paměť za volnou k dalšímu použití. Pokud tak například funkce bude mít lokální proměnnou s hodnotou 5 a vykonání funkce skončí, tato hodnota v paměti zůstane, dokud nebude přepsána příštím zavoláním funkce. V následující animaci můžete vidět sekvenci volání funkcí. Ve sloupci vpravo je zobrazen stav zásobníku při provádění tohoto programu: Šedé obdélníky označují zásobníkové rámce. Modré obdélníky znázorňují hodnoty parametrů v rámci. Červené obdélníky znázorňují hodnoty lokálních proměnných v rámci. Můžete si všimnout, že lokální proměnné mají nedefinovanou hodnotu , dokud do nich není nějaká hodnota zapsána, nicméně paměť pro ně již existuje od začátku provádění funkce. Oranžová šipka označuje, který řádek programu je právě prováděn. Pomocí šipek v levém horním rohu animace se můžete postupně proklikat průběhem vykonání tohoto programu. Uhodnete, jaké číslo tento program vypíše? V animaci si můžete všimnout, že rámce vždy vznikají a zanikají pouze na konci zásobníku. [3] Pokud byste si chtěli tento program spustit lokálně, tak jeho zdrojový kód je dostupný níže. Zdrojový kód programu #include <stdio.h> int fun1(int par) { int res = par * 2; if (res < 50) { return fun1(res); } else { return res; }
}
int fun2(int a, int b) { int x = a + b * 2; int y = fun1(x); return x + y;
}
int main() { printf("%d\n", fun2(5, 6)); return 0;
} Z historických důvodů zásobník roste "dolů", tj. nové rámce se vytvářejí na nižší adrese v paměti.

137.body:
Jelikož před spuštěním programu nevíme, na jaké adrese budou uloženy hodnoty, které nás budou zajímat, tak obvykle nedává smysl inicializovat ukazatel na konkrétní adresu (např. int* p = 5;). Pro inicializaci ukazatele tak existuje několik standardních možností: Inicializace na nulu Pokud chceme vytvořit "prázdný" ukazatel, který zatím neukazuje na žádnou validní adresu, tak se dle konvence inicializuje na hodnotu 0. Takovému ukazateli se pak říká nulový ukazatel ( null pointer ). Jelikož datový typ výrazu 0 je int, tak před přiřazením této hodnoty do ukazatele jej musíme přetypovat na datový typ cílového ukazatele: float* p = (float*) 0; Jelikož tento typ inicializace je velmi častý, standardní knihovna C obsahuje makro NULL, které konverzi nuly na ukazatel provede za vás. Můžete jej najít například v souboru stdlib.h: #include <stdlib.h>
// ...
float* p = NULL; Využití alokační funkce Pokud budete alokovat paměť manuálně , tak použijete funkce, které vám vrátí adresu jako svou návratovou hodnotu. Využití operátoru adresy Pokud chcete ukazatel nastavit na adresu již existující hodnoty v paměti, můžete použít operátor adresy ( address-of operator ). Ten má syntaxi &<proměnná>. Tento operátor se vyhodnotí jako adresa předané proměnné [3] : #include <stdio.h> int main() { int x = 1; int* p = &x; printf("%d\n", x); // hodnota proměnné x printf("%p\n", p); // adresa v paměti, kde je uložena proměnná x return 0;
} Výraz předaný operátoru & se musí vyhodnotit na něco, co má adresu v paměti (většinou to bude proměnná ). Nedává tedy smysl použít něco jako &5, protože 5 je číslo, které nemá samo o sobě žádnou adresu v paměti. Při použití tohoto operátoru je také třeba dávat si pozor na to, aby hodnota v paměti, jejíž adresu použitím & získáme, stále existovala, když se budeme později snažit k této adrese pomocí ukazatele přistoupit. V opačném případu by mohlo dojít k paměťové chybě 💣. Všimněte si, že pro výpis ukazatelů ve funkci printf se používá %p místo %d.

138.body:
Když už máme v ukazateli uloženou nějakou (validní) adresu v paměti, tak k této paměti můžeme přistoupit pomocí operátoru dereference . Ten má syntaxi *<výraz typu ukazatel>. Při použití tohoto operátoru na ukazateli program přečte adresu v ukazateli, podívá se do paměti a načte hodnotu uloženou na této adrese. Podle toho, na jaký datový typ ukazatel ukazuje, se načte odpovídající počet bytů z paměti: #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; printf("%p\n", ukazatel); printf("%d\n", *ukazatel); printf("%d\n", cislo); return 0;
} V tomto programu se do proměnné ukazatel uloží adresa proměnné cislo, a poté dojde k načtení hodnoty (*ukazatel) této proměnné z paměti přes adresu uloženou v ukazateli. Interaktivní vizualizace kódu Pokud chceme do adresy uložené v ukazateli naopak nějakou hodnotu zapsat, tak můžeme operátor dereference použít také na levé straně operátoru zápisu : #include <stdio.h> int main() { int cislo = 1; int* ukazatel = &cislo; *ukazatel = 5; printf("%d\n", cislo); return 0;
} Tento program vypíše 5, protože jsme pomocí ukazatele změnili hodnotu na adrese v paměti, kde leží proměnná cislo. Když při výpisu poté načteme hodnotu proměnné cislo, tak už v ní bude upravená hodnota. Interaktivní vizualizace kódu Pokud provádíte operace s přímo s proměnnou ukazatele, budete vždy pracovat "pouze" s adresou, která je v něm uložena. Pokud chcete načíst nebo změnit hodnotu, která leží v paměti na adrese uložené v ukazateli, musíte použít operátor dereference. Pozor na rozdíl mezi * používanou pro deklaraci datového typu ukazatel, operátorem dereference a operátorem násobení. Všechny tyto věci sice používají hvězdičku, ale jinak spolu nesouvisí. Vždy záleží na kontextu, kde jsou tyto znaky použity: // hvězdička říká, že datový typ proměnné `p` je ukazatel na `int`
int* p; // hvězdička provede dereferenci návratové hodnoty funkce `vrat_ukazatel`
int x = *vrat_ukazatel(); // hvězdička provede násobení dvou čísel
int a = 5 * 6;

139.body:
Abychom se mohli v paměti "posouvat" o určitý kus dopředu či dozadu (relativně k nějaké adrese), můžeme k ukazatelům přičítat či odčítat čísla. Toto se označuje jako aritmetika s ukazateli ( pointer arithmetic ). Tato aritmetika má důležité pravidlo – pokud k ukazateli na konkrétní datový typ přičteme hodnotu n, tak se adresa v ukazateli zvýší o n-násobek velikosti datového typu, na který ukazatel ukazuje. Při aritmetice s ukazateli se tak neposouváme po jednotlivých bytech, ale po celých hodnotách daného datového typu [4] . Z toho vyplývá, že aritmetiku nemůžeme provádět nad ukazateli typu void*, protože ty neukazují na žádný konkrétní datový typ. Například, pokud bychom měli ukazatel int* p s hodnotou 16 (tj. "ukazuje" na adresu 16) a velikost intu by byla 4, tak výraz p + 1 bude ukazatel s hodnotou 20, výraz p + 2 bude ukazatel s adresou 24 atd. Je důležité rozlišovat , jestli při použití sčítání/odčítání pracujeme s hodnotou ukazatele anebo s hodnotou na adrese, která je v ukazateli uložena: int x = 1;
int* p = &x; *p += 1; // zvýšili jsme hodnotu na adrese v `p` (tj. proměnnou `x`) o `1`
p += 1; // zvýšili jsme adresu v `p` o `4` (tj. p nyní už neukazuje na `x`) K čemu je aritmetika s ukazateli užitečná se dozvíte v sekci o práci s více proměnnými zároveň . Kromě dereference a aritmetiky lze s ukazateli provádět také porovnávání (klasicky pomocí operátoru ==). Díky tomu můžeme zjistit, jestli se dvě adresy rovnají.

140.body:
Jak se dozvíte v následující sekci , ukazatele jsou nezbytné pro dynamickou alokaci paměti. Hodí se také při práci s více proměnnými zároveň. Kromě toho je ale lze použít také například v následujících situacích, které všechny souvisí s předáváním adres (ukazatelů) do funkcí: Změna vnějších hodnot zevnitř funkce Hodnoty argumentů předávaných při volání funkcí se do funkce kopírují, nelze tak jednoduše zevnitř funkce měnit hodnoty proměnných, které existují mimo danou funkci. To je sice samo o sobě vhodná vlastnost, protože pokud bude funkce měnit pouze své lokální proměnné, případně parametry, tak bude jednodušší se v ní vyznat. Nicméně, někdy opravdu chceme ve funkci změnit hodnoty externích proměnných. Toho můžeme dosáhnout tak, že si do funkce místo hodnoty proměnné pošleme její adresu v ukazateli, a pomocí této adresy pak hodnotu proměnné změníme. Takto například můžeme vytvořit funkci, která vezme adresy dvou proměnných a prohodí jejich hodnoty: #include <stdio.h> void vymen(int* a, int* b) { int docasna_hodnota = *a; // načti hodnotu na adrese v `a` *a = *b; // načti hodnotu na adrese v `b` a ulož ji na adresu v `a` *b = docasna_hodnota; // ulož uloženou hodnotu na adresu v `b`
}
int main() { int x = 5; int y = 10; vymen(&x, &y); printf("Po prehozeni: x=%d, y=%d\n", x, y); return 0;
} Interaktivní vizualizace kódu Vrácení více návratových hodnot Posílání adres proměnných do funkce můžeme využít také k tomu, abychom z funkce vrátili více než jednu návratovou hodnotu (do adres uložených v parametrech totiž můžeme zapsat "návratové" hodnoty). Toho bychom však měli využívat pouze, pokud je to opravdu nezbytné. Takovéto funkce je totiž složitější volat a nejsou čisté , protože obsahují vedlejší efekt - mění externí stav programu. #include <stdio.h> void vrat_dve_hodnoty(int* a, int* b) { *a = 5; *b = 6;
} int main() { int a = 0; int b = 0; vrat_dve_hodnoty(&a, &b); printf("a=%d, b=%d\n", a, b); return 0;
} Sdílení hodnot bez kopírování Pokud bychom měli proměnné, které v paměti zabírají velké množství bytů (například struktury ), a předávali je jako argumenty funkci, tak může být zbytečně pomalé je pokaždé kopírovat. Pokud do funkce pouze předáme jejich adresu, tak dojde ke kopii pouze jednoho čísla s adresou, nezávisle na tom, jak velká je proměnná, která je na dané adrese uložena. Ukazatele tak můžeme použít ke sdílení hodnot v paměti mezi funkcemi bez toho, abychom je kopírovali.

142.body:
Pokud byste chtěli vytvořit více ukazatelů najednou , musíte si dát pozor na to, že v tomto případě se hvězdička vztahuje pouze k jednomu následujícímu názvu proměnné. Tento kód tak vytvoří ukazatel s názvem x, a dvě celá čísla s názvy y a z: int* x, y, z; Pokud byste chtěli vytvořit tři ukazatele, musíte dát hvězdičku před každý název proměnné: int* x, *y, *z; Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { int a = 2; int* p = &a; p = 5; printf("%d\n", a); return 0;
} Odpověď Program vypíše 2. Přiřazením p = 5 změníme adresu uloženou v ukazateli p na 5. Touto operací se tedy nijak nezmění hodnota proměnné a, jejíž adresu ukazatel před tímto přiřazením obsahoval. Aby k tomuto došlo, museli bychom napsat *p = 5. Co vypíše následující program? #include <stdio.h> int main() { int a = 2; int b = 3; int* p = &a; p = &b; *p += 1; printf("a = %d, b = %d\n", a, b); return 0;
} Odpověď Program vypíše a = 2, b = 4. Nejprve jsme sice nastavili ukazatel p na adresu proměnné a, ale poté jsme do p zapsali adresu proměnné b. Řádek *p += 1; tak zvedne hodnotu v paměti na adrese, kde leží b, o jedničku, jinak řečeno zvýší hodnotu proměnné b o jedničku. Co vypíše následující program? #include <stdio.h> void zmen_ukazatel(int* p, int a) { p = &a;
} int main() { int a = 2; int b = 3; int* p = &b; zmen_ukazatel(p, a); printf("%d\n", *p); return 0;
} Odpověď Program vypíše 3. Když předáme argument typu ukazatele do funkce, tak stejně jako u jiných datových typů dojde k tomu, že se ve funkci vytvoří nová proměnná a do ní se nakopíruje hodnota argumentu. Změna adresy v ukazateli p uvnitř funkce zmen_ukazatel tak neovlivní adresu v ukazateli p uvnitř funkce main. A jelikož p v mainu ukazuje na proměnnou b, tak dereference tohoto ukazatele se vyhodnotí jako hodnota 3. Co vypíše následující program? #include <stdio.h> int main() { int a = 2; int* p = &a; *p = 4; int b = *p; *p = 8; printf("a = %d, b = %d\n", a, b); return 0;
} Odpověď Program vypíše a = 8, b = 4. Při vytváření proměnné b se hodnota na adrese uložené v ukazateli p uloží do b. V danou chvíli je na této adrese uložena hodnota 4, proto se do proměnné b uloží právě hodnota 4. Další změny hodnot na adrese uložené v p už proměnnou b neovlivní. Co vypíše následující program? #include <stdio.h> int main() { int a = 2; int* p = &a; printf("%d\n", p); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣, protože jsme použili zástupný znak %d, který slouží k výpisu celých čísel, ale předali jsme funkci printf argument p, který je datového typu ukazatel. Správně můžeme buď použít zástupný znak %p, abychom vypsali adresu uloženou v ukazateli, nebo můžeme použít dereferenci a vypsat hodnotu uloženou na adrese v ukazateli: printf("%p\n", p);
printf("%d\n", *p); Co vypíše následující program? #include <stdio.h> int main() { int a = 2; int b = 3; int* p = &a; int** px = &p; *px = &b; *p = 8; printf("a = %d, b = %d\n", a, b); return 0;
} Odpověď Program vypíše a = 2, b = 8. Proměnná px je ukazatel na ukazatel na int. Obsahuje adresu, kde v paměti leží proměnná p. Pomocí *px změníme hodnotu na této adrese na &b, tj. adresu proměnné b. V podstatě je to to stejné, jako kdybychom napsali p = &b. Zkuste si na papír nakreslit, jak tento program bude vypadat v paměti, jaké adresy/hodnoty budou v jednotlivých proměnných. Výsledek si můžete ověřit touto vizualizací.

146.body:
Pokud chcete nastavit do ukazatele na funkci nějakou hodnotu, stačí do něj přiřadit název existující funkce. int funkce(int x) { return x + 1;
} int main() { int (*ukazatel)(int) = funkce; return 0;
} Signatura přiřazené funkce musí odpovídat datovému typu ukazatele, nelze tak například přiřadit funkci, která nic nevrací, do ukazatele, který má signaturu int (*)(). Jakmile máme v proměnné ukazatele na funkci uloženou adresu nějaké funkce, můžeme pomocí názvu této proměnné danou funkci zavolat. #include <stdio.h> int funkce(int x) { printf("Funkce zavolana s parametrem %d\n", x); return x + 1;
} int main() { int (*ukazatel)(int) = funkce; int ret = ukazatel(1); printf("Funkce vratila %d\n", ret); return 0;
}

147.body:
K čemu vlastně ukazatel na funkce může sloužit? Už víme, že pomocí funkcí můžeme parametrizovat kód, což nám umožňuje používat identický kód nad různými vstupními hodnotami bez toho, abychom tento kód museli neustále duplikovat. Prozatím jsme pro parametrizaci používali pouze jednoduché hodnoty, jako čísla nebo pravdivostní hodnoty. Pomocí ukazatelů na funkce však můžeme parametrizovat samotný kód, který se má uvnitř nějaké funkce provést. Představte si například, že chcete vytvořit funkci, která provede nějakou operaci (např. přičtení konstanty, vynásobení konstantou nebo vypsání na výstup) s číslem, ale pouze v případě, že toto číslo je kladné. V opačném případě by měla funkce toto číslo pouze vrátit, bez jakékoliv změny. Jak byste tuto funkci napsali, bez toho, abyste ji duplikovali pro každou operaci, která se má s kladným číslem provést? První řešení by mohlo vypadat například takto: #include <stdio.h> int proved_pro_kladne(int cislo, int operace) { if (cislo <= 0) return cislo; if (operace == 0) { return cislo * 3; } else if (operace == 1) { return cislo + 1; } else { printf("Cislo: %d
", cislo); return cislo; }
} int main() { printf("%d
", proved_pro_kladne(-1, 0)); printf("%d
", proved_pro_kladne(1, 0)); printf("%d
", proved_pro_kladne(1, 1)); printf("%d
", proved_pro_kladne(1, 2)); return 0;
} Toto řešení jistě bude fungovat, nicméně je dost nepraktické, protože musíme ve funkci proved_pro_kladne dopředu vyjmenovat všechny možné operace, které lze s číslem provést. Pokud bychom tak chtěli přidat novou operaci, budeme muset tuto funkci upravit. Zároveň je také dost nepřehledné předávat funkci informaci o tom, jaká operace se má provést, pomocí proměnné typu int (parametr operace). Pomocí ukazatele na funkci můžeme funkci proved_pro_kladne předat kód [2] , který se má provést, pokud je předané číslo kladné. Pomocí toho můžeme od sebe oddělit logiku naší funkce (kontrola, jestli je číslo kladné či ne) a samotnou operaci, která se má provést s kladným číslem. Pokud tak vytvoříme novou operaci, nemusíme funkci proved_pro_kladne jakkoliv upravovat, stačí ji zavolat s jiným argumentem. Ve formě adresy funkce. #include <stdio.h> int proved_pro_kladne(int cislo, int(*operace)(int)) { if (cislo <= 0) return cislo; return operace(cislo);
} int vynasob_dvema(int cislo) { return cislo * 2; }
int pricti_jednicku(int cislo) { return cislo + 1; }
int vypis(int cislo) { printf("Cislo: %d
", cislo); return cislo;
} int main() { printf("%d
", proved_pro_kladne(-1, vynasob_dvema)); printf("%d
", proved_pro_kladne(1, vynasob_dvema)); printf("%d
", proved_pro_kladne(1, pricti_jednicku)); printf("%d
", proved_pro_kladne(1, vypis)); return 0;
} Ukazatele na funkce nám umožňují vytvářet kód, který je více composable , jinak řečeno lze jej skládat jako kostky Lega a nenutí nás zadrátovat všechny možné způsoby použití dopředu (jako tomu bylo v prvním řešení s parametrem int operace). Ještě užitečnější jsou ukazatele na funkci v kombinacemi se zpracováním více hodnot pomocí polí , kdy můžeme napsat obecnou funkci, která nějak zpracovává pole, a předat jí například ukazatel na funkci, která se má zavolat nad každým prvkem v poli. Hodí se také při práci se strukturami , kdy můžeme do atributu struktury uložit ukazatel na funkci a přidat tak individuální chování k různým hodnotám stejné struktury.

150.body:
Parametr size udává, kolik bytů paměti se má naalokovat. Tuto velikost můžeme "tipnout" manuálně, nicméně to není moc dobrý nápad, protože bychom si museli pamatovat velikosti datových typů (přičemž jejich velikost se může lišit v závislosti na použitém operačním systému či překladači!). Abychom tomu předešli, tak můžeme použít operátor sizeof, kterému můžeme předat datový typ [2] . Tento výraz se poté vyhodnotí jako velikost daného datového typu: #include <stdio.h>
int main() { printf("Velikost int je: %lu\n", sizeof(int)); printf("Velikost int* je: %lu\n", sizeof(int*)); return 0;
} Případně výraz, v tom případě si sizeof vezme jeho datový typ. Návratový typ void* reprezentuje ukazatel na libovolná data. Funkce malloc musí fungovat pro alokaci libovolného datového typu, proto musí mít jako návratový typ právě univerzální ukazatel void*. Při zavolání funkce malloc bychom měli tento návratový typ přetypovat na ukazatel na datový typ, který alokujeme. Při zavolání mallocu dojde k naalokování size bytů na haldě. Adresa prvního bytu této naalokované paměti se poté vrátí jako návratová hodnota mallocu. Zde je ukázka programu, který naalokuje paměť pro jeden int ve funkci, adresu naalokované paměti poté vrátí jako návratovou hodnotu a naalokovaná paměť je poté přečtena ve funkci main: #include <stdlib.h> int* naalokuj_pamet() { int* pamet = (int*) malloc(sizeof(int)); *pamet = 5; return pamet; }
int main() { int* pamet = naalokuj_pamet(); printf("%d\n", *pamet); free(pamet); // uvolnění paměti, vysvětleno níže return 0;
} Interaktivní vizualizace kódu

158.body:
Hodnota zadaná v hranatých závorkách by měla být "konstantním výrazem", tj. buď přímo číselná hodnota anebo číselná hodnota pocházející z makra [3] . Pokud budete potřebovat pole dynamické velikosti, tak byste měli použít dynamickou alokaci paměti . Dokonce ani konstantní proměnná není v C "konstantním výrazem". Jazyk C od verze C99 již sice povoluje dávat do hranatých závorek i "dynamické" hodnoty, tj. výrazy, jejichž hodnota nemusí být známa v době překladu: int velikost = ...; // velikost se načte např. ze souboru
int pole[velikost]; Tato funkcionalita zvaná VLA (variable-length array) je nicméně určená pro velmi specifické použití a nese s sebou různé nevýhody, proto ji v rámci předmětu UPR nepoužívejte . Pokud si chcete být jisti, že se VLA ve vašem kódu nevyskytuje, překládejte své programy s parametrem překladače -Werror=vla. Proč ne VLA? Zásobník má značně omezenou velikost a není určen pro alokaci velkého množství paměti [4] . Pokud velikost takovéhoto pole může ovlivnit uživatel programu (např. zadáním vstupu), může váš program jednoduše "shodit" (v lepším případě) nebo způsobit přepsání existující paměti (v horším případě), pokud by zadal velké číslo a došlo by k pokusu o vytvoření moc velkého pole na zásobníku. VLA má také různé problémy s kompatibilitou mezi překladači a jeho implementace překladači není zdaleka triviální. Alokace paměti s dynamickou velikostí na zásobníku se může hodit ve velmi specifických případech, např. při vývoji embedded zařízení nebo při vysoce efektivní práci s I/O (vstup/výstup). Nicméně pro účely běžného programování v C a předmětu UPR rozhodně není potřeba, proto se VLA prosíme zkuste vyhnout. Můžete si například zkusit přeložit následující program: int main() { int pole[10000000]; return 0;
} Při spuštění by měl program selhat na paměťovou chybu , i když váš počítač má pravděpodobně více než 10000000 * 4 (cca 38 MiB) paměti. Pokud chcete alokovat více než několik stovek bytů, použijte raději dynamickou alokaci na haldě.

161.body:
Abychom využili toho, že nám pole umožňují vytvořit větší množství paměti najednou, musíme mít možnost přistupovat k jednotlivým prvkům v poli. K tomu můžeme využít ukazatelů . Proměnná pole se totiž chová jako ukazatel na první prvek (prvek na nultém indexu!) daného pole, pomocí operátoru dereference tak k tomutu prvku můžeme jednoduše přistoupit: #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *pole); return 0;
} Abychom přistoupili i k dalším prvkům v poli, tak můžeme využít aritmetiky s ukazateli . Pokud chceme získat adresu prvku na i-tém indexu, stačí k ukazateli na první prvek přičíst i [5] : #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d
", *(pole + 0)); // první prvek pole printf("%d
", *(pole + 1)); // druhý prvek pole printf("%d
", *(pole + 2)); // třetí prvek pole return 0;
} Všimněte si, že při použití operátoru dereference zde používáme závorky. Je to z důvodu priority operátorů . Výraz *pole + 2 by se vyhodnotil jako první prvek z pole pole plus 2, protože * (dereference) má větší prioritu než sčítání. Nyní už možná tušíte, proč se při práci s poli vyplatí počítat od nuly. Prvek na nultém indexu je totiž vzdálen nula prvků od začátku pole. Prvek na prvním indexu je vzdálen jeden prvek od začátku pole atd. Pokud bychom indexovali od jedničky, museli bychom při výpočtu adresy relativně k ukazateli na začátek pole vždy odečíst jedničku, což by bylo nepraktické. Přistupování k prvkům pole se běžně označuje pojmem indexování pole .

162.body:
Jelikož je operace přístupu k poli ("posunutí" ukazatele a jeho dereference) velmi běžná (a zároveň relativně krkolomná), C obsahuje speciální operátor, který ji zjednodušuje. Tento operátor se nazývá array subscription operator a má syntaxi <výraz a>[<výraz b>] Slouží jako zkratka [6] za výraz *(<výraz a> + <výraz b>) Příklad: pole[0] je ekvivalentní výrazu *(pole + 0) pole[5] je ekvivalentní výrazu *(pole + 5) int pole[3] = { 1, 2, 3 };
pole[0] = 5; // nastavili jsme první prvek pole na hodnotu `5`
int c = pole[2]; // nastavili jsme `c` na hodnotu posledního (třetího) prvku pole Takovéto "zkratky", které v programovacím jazyku nepřináší novou funkcionalitu, pouze zkracují či zjednoduššují často používané kombinace příkazů, se označují jako syntactic sugar . Jelikož je používání hranatých závorek přehlednější než používání závorek a hvězdiček, doporučujeme je používat pro přistupování k prvkům pole, pokud to půjde. Pozor na rozdíl mezi tímto operátorem a definicí pole. Obojí sice používá hranaté závorky, ale jinak spolu tyto dvě věci nesouvisejí. Podobně jako se * používá pro definici datového typu ukazatele a zároveň jako operátor dereference (navíc i jako operátor pro násobení). Vždy záleží na kontextu, kde jsou tyto znaky použity.

165.body:
Už víme, že když předáváme argumenty do funkcí, tak se jejich hodnota zkopíruje. U statických polí tomu tak ovšem není, protože pole můžou být potenciálně velmi velká a provádění kopií polí by tak potenciálně mohlo brzdit provádění programu. Když tak použijeme proměnnou pole jako argument při volání funkce, dojde k tzv. konverzi pole na ukazatel ( array to pointer decay ). Pole se tak vždy předá jako ukazatel na jeho první prvek: #include <stdio.h> void vypis_pole(int* pole) { printf("%d\n", pole[0]);
} int main() { int pole[3] = { 1, 2, 3 }; vypis_pole(pole); return 0;
} Pro parametry sice můžete použít datový typ pole: void vypis_pole(int pole[3]) { ... } nicméně i v tomto případě se bude takovýto parametr chovat stejně jako ukazatel (v tomto případě tedy int*). Navíc překladač ani nebude kontrolovat, jestli do takového parametru opravdu dáváme pole se správnou velikostí. Pro parametry reprezentující pole tak raději rovnou používejte ukazatel, abychom čtenáře kódu nemátli.

166.body:
Když ve funkci přijmeme jako parametr ukazatel na pole, tak nevíme, kolik prvků v tomto poli je. Tato informace je ale stěžejní, bez ní totiž nevíme, ke kolika prvkům pole si můžeme dovolit přistupovat. Pokud tedy ukazatel na pole předáváme do funkce, je obvykle potřeba zároveň s ním předat i délku daného pole: int secti_pole(int* pole, int velikost) { int soucet = 0; for (int i = 0; i < velikost; i++) { soucet += pole[i]; } return soucet;
} Výpočet velikosti pole Abyste při změně velikosti statického pole nemuseli ručně jeho velikost upravovat na více místech v kódu, tak můžete ve funkci, kde definujete statické pole, vypočítat jeho velikost pomocí operátoru sizeof: int pole[3] = { 1, 2, 3 };
printf("Velikost pole v bytech: %lu\n", sizeof(pole)); Abyste zjistili počet prvků ve statickém poli, můžete velikost v bytech vydělit velikostí každého prvku v poli: int pole[3] = { 1, 2, 3 };
printf("Pocet prvku v poli: %lu\n", sizeof(pole) / sizeof(pole[0])); Operátor sizeof bude pro toto použití fungovat pouze pro statické pole a pouze ve funkci, ve které statické pole vytváříte! Pokud pole pošlete do jiné funkce, už z něj bude pouze ukazatel, pro který sizeof vrátí velikost ukazatele (což bude na vašem PC nejspíše 8 bytů). Více v kvízech níže. Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { int pole[3] = { 1, 4, 7 }; int a = *pole + 1; int b = *(pole + 1); printf("a = %d, b = %d\n", a, b); return 0;
} Odpověď Program vypíše a = 2, b = 4. Jelikož má operátor dereference (*) větší prioritu než operátor sečtení (+), tak se do proměnné a uloží hodnota (2). Nejprve se totiž provede výraz *pole, kde dojde k dereferenci ukazatele na první prvek pole, čímž vznikne hodnota 1, a k ní se poté přičte jednička. V případě proměnné b se nejprve ukazatel na první prvek pole posune o jeden prvek dopředu, tj. na adresu druhého prvku pole, který má hodnotu 4. Poté dojde k dereferenci adresy tohoto prvku, do proměnné b se tak uloží hodnota 4. Co vypíše následující program? #include <stdio.h> void prijmi_pole(int p[3]) { p[2] += 1;
} int main() { int pole[3] = { 1, 2, 3 }; prijmi_pole(pole); printf("{ %d, %d, %d }\n", pole[0], pole[1], pole[2]); return 0;
} Odpověď Program vypíše { 1, 2, 4 }. Při předávání statického pole do funkce dojde pouze k předání ukazatele na jeho první prvek (i když má parametr typ int p[3]). Pokud tedy pomocí ukazatele p změníme hodnotu třetího prvku pole, tato změna se nám projeví i ve funkci main, protože stále pracujeme s tou stejnou pamětí. Co vypíše následující program? #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; int *p = pole; p[1] = 5; pole[0] = 8; printf("%d, %d\n", *p, pole[1]); return 0;
} Odpověď Program vypíše 8, 5. Do ukazatele p jsme si uložili adresu prvního prvku v poli. Pomocí p[1] posuneme ukazatel o jeden prvek v paměti "dopředu" (bude tedy ukazovat na druhý prvek pole) a rovnou na tuto adresu v paměti zapíšeme hodnotu 5. Poté změníme hodnotu prvního prvku pole na 8. Jelikož p ukazuje na první prvek v poli, tak při jeho dereferenci získáme právě hodnotu 8. A jelikož jsme předtím pomocí ukazatele p změnili druhý prvek pole na 5, tak pole[1] také vrátí hodnotu 5. Co vypíše následující program? #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; printf("%d\n", pole); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣, protože jsme použili zástupný znak %d, který slouží k výpisu celých čísel, ale předali jsme funkci printf argument pole, který je datového typu pole (resp. ukazatel na první prvek tohoto pole). Co vypíše následující program? #include <stdio.h> int main() { int p[3] = { 1, 2, 3 }; for (int i = 0; i <= 3; i++) { printf("%d\n", p[i]); } return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣, protože jsme přistoupili (dereferencovali) paměť mimo rozsah pole! Pole p má pouze tři prvky, nesmíme tedy přistoupit k indexu 3 či vyššímu, což se však v tomto programu stane, protože proměnná i nabývá hodnot 0, 1, 2 a 3. Ať už tento program při konkrétním spuštění vypíše cokoliv, nemá cenu se tím zaobírat. Tento program obsahuje paměťovou chybu, která může způsobit pád programu, libovolnou změnu hodnot v paměti nebo cokoliv jiného. Chybu musíte nejprve odstranit, jinak program nebude správně fungovat. Co vypíše následující program? #include <stdio.h> int main() { int pole[3] = { 1, 2, 3 }; 2[pole] = 5; printf("%d\n", pole[2]); return 0;
} Odpověď Program vypíše 5. I když to vypadá zvláštně, tak jelikož je sčítání komutativní, a operátor a[b] je definován jako *(a + b), tak je jedno, jestli napíšete a[b] nebo b[a]. Takovýto zápis je nicméně nestandardní a nepoužívá se, tato úloha pouze měla demonstrovat, že jej takto teoreticky použít lze, a že a[b] opravdu není nic jiného, než zkratka za *(a + b). Co vypíše následující program? #include <stdio.h> int main() { char pole[3]; char* ptr = pole; printf("%d\n", (int) sizeof(pole)); printf("%d\n", (int) sizeof(ptr)); return 0;
} Odpověď Program vypíše toto (na 32-bitovém systému by druhé číslo bylo pravděpodobně 4): 3
8 Operátor sizeof vrátí velikost celého statického pole, pokud jej do něj předáme. Pokud však do něj dáme pouze ukazatel, tak sizeof neví, jak velká paměť leží na adrese uložené v tomto ukazateli, proto nám místo toho vrátí pouze velikost daného ukazatele, což bude na 64-bitovém systému pravděpodobně 8 bytů. Co vypíše následující program? #include <stdio.h> void print_size(char pole[3]) { printf("%d\n", (int) sizeof(pole));
} int main() { char pole[3]; print_size(pole); return 0;
} Odpověď Program pravděpodobně vypíše řádek s hodnotou 8 (na 64-bitovém systému) či 4 (na 32-bitovém systému). Pokud použijeme datový typ pole jako parametr funkce, tak se k němu překladač bude víceméně chovat jako k běžnému ukazateli. Je to z toho důvodu, že překladač neví, jak velkou paměť do funkce předáváme (můžeme tuto funkci zavolat s ukazatelem na různě velká pole!). Z toho důvodu je tak lepší pro parametry funkcí vždy používat rovnou ukazatel a ne pole, abychom zamezili nejasnostem. Tyto následující tři signatury funkce jsou tedy v podstatě totožné: void print_size(char pole[3]);
void print_size(char pole[]);
void print_size(char* pole);

171.body:
Při práci s dvourozměrným polem bychom chtěli pracovat s dvourozměrným indexem (řádek i, sloupec j), nicméně při samotném přístupu do paměti pak musíme tento vícerozměrný index převést na 1D index. A naopak, z 1D indexu bychom chtěli mít možnost získat zpět 2D index. Pro výpočet indexů 2D pole s vyska řádky a sirka sloupci můžeme použít tyto jednoduché vzorce: Převod z 2D do 1D - abychom se dostali na cílovou pozici, musíme přeskočit radek řádků, kde každý řádek má sirka prvků, a poté ještě musíme přičíst pozici sloupce (sloupec). int index_2d_na_1d(int radek, int sloupec, int sirka) { return radek * sirka + sloupec;
} Převod z 1D do 2D - pro převod z 1D indexu zpět na 2D index stačí aplikovat opačný postup. Nejprve vydělíme 1D index počtem sloupců, abychom zjistili, na jakém jsme řádku, a poté použijeme zbytek po dělení, abychom zjistili, na jakém jsme sloupci. void index_1d_na_2d(int index, int sirka, int* radek, int* sloupec) { *radek = index / sirka; *sloupec = index % sirka;
} Tento koncept lze zobecnit na libovolně rozměrné pole (3D, 4D, …).

183.body:
Vytváření řetězců tímto způsobem je nicméně celkem zdlouhavé a nepřehledné. Často chceme v programu jednoduše a rychle zapsat krátký textový řetězec tak, aby šel přehledně přečíst. K tomu můžeme využít tzv. řetězcový literál ( string literal ), který lze vytvořit tak, že napíšeme text do dvojitých uvozovek ("). Pokud tedy v našem programu vytvoříme například literál "UPR", tak se stane následující: Překladač při překladu uloží do výsledného spustitelného souboru pole reprezentující daný řetězec. V tomto případě půjde o pole velikosti 4 s hodnotami 'U', 'P', 'R' a '\0'. Při spuštění programu se toto pole načte do globální paměti v sekci adresního prostoru, která je určena pouze pro čtení. Do takto vytvořeného řetězce tak nelze zapisovat, lze jej pouze číst [2] . Samotný výraz literálu se při běhu programu vyhodnotí jako adresa prvního znaku řetězce uloženého v globální paměti. Datový typ literálu bude ukazatel na konstantní znak , tedy const char*. Tento datový typ říká, že hodnotu znaku na dané adrese nelze měnit. Tyto řetězce jsou pouze pro čtení zejména z toho důvodu, aby je šlo sdílet. Pokud například v programu použijete třikrát stejný řetězcový literál, překladač může v paměti pole pro tento literál vytvořit pouze jednou, aby ušetřil paměť. Kvůli toho ale musí být řetězce pouze pro čtení, pokud bychom totiž takto sdílený řetězec změnili, změnilo by to i hodnotu všech ostatních literálů, které se vyhodnotí na jeho adresu, což by bylo dost neintuitivní. Pomocí řetězcového literálu si tak můžeme značne usnadnit zápis řetězců v programech, jelikož nemusíme přemýšlet nad délkou pole, nemusíme pamatovat na umístění znaku '\0' na konec řetězce a ani nemusíme obalovat jednotlivé znaky do apostrofů: #include <stdio.h> int main() { const char* text = "UPR"; printf("%s\n", text); return 0;
} Je však třeba pamatovat na to, že takto vytvořené řetězce jsou opravdu pouze pro čtení, a nesmíme tak do nich zapisovat. Pokud je budete ukládat do proměnné, tak použijte datový typ const char*, díky kterému vás překladač bude hlídat, abyste se do takovéhoto řetězce omylem nesnažili něco zapsat. Pokud byste chtěli použít řetězcový literál pro vytvoření řetězce, který lze měnit, můžete ho uložit do proměnné typu char[] (tj. pole znaků): #include <stdio.h> int main() { char text[] = "UPR"; text[0] = 'A'; printf("%s\n", text); return 0;
} V takovémto případě se hodnota z literálu překopíruje do proměnné pole znaků na zásobníku, který již lze měnit. Pokud jsou vám řetězcové literály povědomé, je to kvůli toho, že jsme je již mnohokrát využili při volání funkce printf. Víceřádkové řetězcové literály Pokud budete chtít zapsat řetězcový literál na více řádků kódu, můžete buď na konci každého neukončeného řádku použít znak \: const char* veta = "Ahoj \
jmenuji \
se \
Karel"; nebo každý řádek samostatně obalit uvozovkami: const char* veta = "Ahoj"
"jmenuji"
"se"
"Karel"; Pozor však na to, že v ani jednom ze zmíněných případů nebude součástí řetězce znak odřádkování. Ten musíte vždy přidat explicitně: const char* radky = "radek1\n\
radek2\n\
radek3\n"; // nebo
const char* radky = "radek1\n"
"radek2\n"
"radek3\n";

184.body:
U polí je trochu nepraktické to, že pokud je chceme poslat do nějaké funkce, musíme spolu s ukazatelem na první prvek pole předat také jeho velikost , aby funkce věděla, ke kolika prvkům si může dovolit přistoupit. Jiným způsobem, jak určit velikost pole, je zvolit si speciální hodnotu, která bude značit konec pole. Když kód, který s takovýmto polem bude pracovat, na tuto speciální hodnotu narazí, tak bude vědět, že dále v paměti již pole nepokračuje. Tento mechanismus je využit právě u řetězců zakončených nulou, kde onou speciální hodnotou je právě tzv. NUL znak, který má číselnou hodnotu 0. Například při procházení řetězce v cyklu tak nemusíme dopředu znát jeho délku, stačí cyklus ukončit, jakmile narazíme na znak '\0'. Například funkce pro spočtení délky řetězce by mohla vypadat takto [3] : int delka_retezce(const char* retezec) { int delka = 0; // dokud není znak na adrese v ukazateli roven znaku NUL while (*retezec != '\0') { delka = delka + 1; retezec = retezec + 1; // posuň ukazatel o jeden znak dále } return delka;
} Tato funkce postupně projde všechny znaky řetězce a počítá, kolik jich je, dokud nenarazí na znak '\0. Pro procházení řetězce je zde použita aritmetika s ukazateli . Všimněte si, že tato funkce bere ukazatel na konstantní pole znaků. Pokud ve funkci nepotřebujete měnit hodnoty pole, je obvykle dobrý nápad použít klíčové slovo const před datovým typem obsaženým v poli, aby vás překladač ohlídal, že se pole nesnažíte měnit. Do takovéto funkce pak klidně můžete poslat i pole, které ve skutečnosti měnit lze, jinak řečeno např. char* lze bez problému převést na const char*. V opačném směru konverze není korektní. Z toho vyplývá mimo jiné to, že znak NUL nemůže být použit "uprostřed" řetězce. Pokud by tomu tak bylo, tak funkce, které by s takovýmto řetězcem pracovaly, by při nalezení tohoto znaku přestaly řetězec zpracovávat, a jakékoliv další znaky za NUL by byly ignorovány. Uhodnete tak, co vypíše následující program? #include <stdio.h> int main() { char text[] = {'U', '\0', 'P', 'R', '\0'}; printf("%s\n", text); return 0;
}

186.body:
Standardní knihovna C obsahuje řadu funkcí , které umí s řetězci zakončenými nulou pracovat. Zde je seznam několika vybraných funkcí, které pro vás můžou být užitečné: Zjištění délky řetězce : funkce strlen bere jako parametr řetězec a vrací jeho délku. Jedná se o jednu z nejčastěji používaných funkcí při práci s řetězci a vyplatí se ji tak znát. Při jejím použití je ovšem nutné si dát pozor na to, že délka provádění této funkce závisí na tom, jak je řetězec dlouhý. Pokud bude mít řetězec milion znaků, tak bude tato funkce muset projít všech milion znaků, dokud nenarazí na znak NUL. Dávejte si tak pozor, abyste tuto funkci nevolali zbytečně často. Například pokud použijete funkci strlen v podmínce cyklu for: for (int i = 0; i < strlen(retezec); i++) { ...
} Tak se délka řetězce vypočte při každé iteraci cyklu. Pokud by tak řetězec měl milion znaků, musel by program provést bilion [4] (!) operací pouze pro zjištění délky řetězce. Lepší volbou (pokud se tedy délka řetězce nemění) je tak předpočítat si jeho délku dopředu a uložit si ji do proměnné: int delka = strlen(retezec);
for (int i = 0; i < delka; i++) { ...
} 1 000 000 000 000 Porovnání dvou řetězců : běžnou operací, kterou bychom s řetězci chtěli udělat, je porovnat, zdali jsou dva řetězce stejné, popřípadě který z nich je menší [5] . Funkce strcmp bere dva řetězce a vrací nulu, pokud se řetězce rovnají, zápornou hodnotu, pokud je první řetězec menší než ten druhý, a kladnou hodnotu, pokud je druhý řetězec menší než první. Pro porovnávání dvou řetězců nikdy nepoužívejte operátor ==! Nebude to fungovat . Pro porovnávání řetězců se používá lexikografické uspořádání . Nalezne se první dvojice znaků (zleva), ve kterém se řetězce liší, a tyto dva znaky se porovnají pomocí jejich číselné (ASCII) hodnoty. Vyhledání řetězce v řetězci : pokud chcete zjistit, jestli se v nějakém řetězci vyskytuje jiný řetězec, můžete použít funkci strstr . Převod textu na číslo : často můžete potřebovat převést textový zápis čísla na jeho číselnou hodnotu. K tomu můžete použít například funkci strtol ( string to long ). První parametr funkce je řetězec, který chcete převést, do druhého parametru můžete předat ukazatel na ukazatel na znak, do kterého se uloží pozice ve vstupním řetězci těsně za načteným číslem. Posledním parametrem je soustava, ve které se má číslo načíst (obvykle to bude desítková soustava, tedy hodnota 10). Návratovou hodnotou funkce je pak načtené číslo. Můžete použít také funkci atoi , která je trochu jednodušší na použití, ale při jejím použití nelze zjistit, zdali při konverzi nedošlo k chybě (například pokud vstupní řetězec nereprezentoval číslo). Cvičení 🏋 Pro procvičení práce s řetězci si můžete zkusit některé z těchto funkcí sami naprogramovat. Další úlohy pro práci s řetězci můžete nalézt zde . Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { const char* str = "hello"; printf("%c\n", str[3]); printf("%c\n", str[2]); printf("%c\n", str[1]); return 0;
} Odpověď Program vypíše: l
l
e Jelikož jsou řetězce poli znaků, tak při přistoupení na nějaký index řetězce získáme hodnotu datového typu znak. Co vypíše následující program? #include <stdio.h> int main() { const char* str = "hello"; for (int i = 0; i < 5; i++) { printf("%c", str[i] - 32); } printf("\n"); return 0;
} Odpověď Program vypíše HELLO. Když se podíváte na ASCII tabulku , tak zjistíte, že rozdíl mezi čísly reprezentujícími jednotlivé znaky malé a velké anglické abecedy je 32, a že znaky malé abecedy jsou reprezentovány vyššími čísly. Když tak např. od 'h' odečteme hodnotu 32, získáme znak 'H'. Přehlednější by bylo napsat tuto konverzi jako str[i] - ('a' - 'A') nebo použít funkci tolower ze standardní knihovny jazyka C .

193.body:
Načítat vstup po jednotlivých znacích je poměrně zdlouhavé. Velmi často chceme ze vstupu načíst delší úsek textu najednou, například celý řádek. Toho můžeme dosáhnout například použitím funkce fgets . Ta jako parametry přijímá ukazatel na řetězec, do kterého zapíše načítaný řádek a maximální počet znaků, který lze načíst [2] . Třetí parametr je soubor , ze kterého se má vstup načíst. O souborech se dozvíte více později, pokud chcete načítat data ze standardního vstupu, tak použijte jako třetí parametr globální proměnnou stdin, která je nadefinována v souboru <stdio.h>. Pro jednoduché zjištění délky řetězce, do kterého zapisujete, můžete použít operátor sizeof: Tato velikost je včetně znaku '\0', který je vždy zapsán na konec vstupního řetězce. Pokud tak máte řetězec (pole) o délce 10, předejte do fgets hodnotu 10. Funkce načte maximálně 9 znaků a na konec řetězce umístí znak '\0'. #include <stdio.h> int main() { char buf[80]; // načti řádek textu ze vstupu do řetězce `buf` fgets(buf, sizeof(buf), stdin); return 0;
} Pokud tato funkce vrátí návratovou hodnotu NULL, tak při načítání došlo k chybě. Tuto chybu byste tak ideálně měli nějak ošetřit: #include <stdio.h> int main() { char buf[80]; if (fgets(buf, sizeof(buf), stdin) == NULL) { printf("Nacteni dat nevyslo. Ukoncuji program\n"); return 1; } return 0;
} Pokud byl na vstupu řádek ukončený odřádkováním (\n), tak se toto odřádkování bude nacházet i v načteném řetězci po zavolání fgets! Pokud tedy takto načtený řetězec chcete například porovnat s jiným řetězcem, měli byste nejprve znak odřádkování odstranit. Více se můžete dozvědět zde .

195.body:
Pomocí scanf můžeme načítat také celé řetězce pomocí zástupného znaku %s. Zde si ovšem musíme dávat pozor, abychom u něj uvedli i maximální délku řetězce, do kterého chceme text načíst [3] : char buf[21];
scanf("%20s", buf); Narozdíl od funkce fgets se zde musí uvést délka o jedna menší, než je délka cílového řetězce, do kterého znaky zapisujeme. Pokud bychom použili zástupný znak %s bez uvedené velikosti cílového řetězce, snadno by se mohlo stát, že nám uživatel zadá moc dat, které by funkce scanf začala vesele zapisovat i za paměť předaného řetězce, což může vést buď k pádu programu (v tom lepším případě) nebo ke vzniku bezpečnostní zranitelnosti, pomocí které by uživatel našeho programu mohl například získat přístup k počítači, na kterém program běží (v tom horším případě): char buf[21];
// pokud uživatel zadá více než 20 znaků, může svým vstupem začít přepisovat paměť
// běžícího programu
scanf("%s", buf);

196.body:
Funkce scanf ignoruje bílé znaky (mezery, odřádkování, tabulátory atd.) mezi jednotlivými zástupnými znaky ve formátovacím řetězci. Například v následujícím kódu je validním vstupem x8, x 8 i x 8: int a;
scanf("x%d", &a); I když může toto chování být užitečné, někdy je také celkem neintuitivní. Problém může způsobovat zejména, pokud se pro načítání vstupu kombinuje formátované načítání (scanf) s neformátovaným načítáním (např. fgets). Funkce scanf totiž bílé znaky nechá ve vstupu ležet, pokud je nepotřebuje zpracovat. Následující program načítá číslo pomocí funkce scanf a poté se snaží načíst následující řádek textu pomocí funkce fgets: int cislo;
scanf("%d", &cislo); char radek[80];
fgets(radek, sizeof(radek), stdin); Pokud tomuto programu předáme text 5\nahoj, očekávali bychom, že se v řetězci radek objeví ahoj. Nicméně funkce scanf načte číslo 5 a nechá ve vstupu ležet znak odřádkování, protože nic dalšího načíst nepotřebuje. Funkce fgets poté uvidí znak odřádkování, načte jej a skončí své provádění (načte prázdný řádek), což zřejmě není chování, které bychom od programu čekali.

198.body:
Další možností, jak předat nějaký vstup vašemu programu, je předat mu parametry při spuštění v terminálu: $ ./program arg1 arg2 arg3 K těmto předaným řetězcům poté lze přistoupit ve funkci main . Kvíz 🤔 Co vypíše následující program, pokud na vstup zadáme 5? #include <stdio.h> int main() { int a; scanf("%d", a); printf("Hodnota: %d\n", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Funkce scanf očekává pro každý zástupný znak ve svém formátovacím řetězci další argument, který musí obsahovat adresu , do které se daná hodnota ze vstupu uloží. Zde místo adresy předáváme do scanf hodnotu číselné proměnné, která navíc ani není inicializovaná, takže její předání do funkce je samo o sobě také nedefinovaným chováním. Co vypíše následující program, pokud na vstup zadáme 5? #include <stdio.h> int main() { int* p; scanf("%d", p); printf("Hodnota: %d\n", p); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Sice správně do funkce scanf předává adresu celého čísla, ale tato adresa je neinicializovaná! Adresy předané funkci scanf po formátovacím řetězci jsou výstupnímu argumenty, jinak řečeno do předaných adres budou zapsány hodnoty načtené ze vstupu. Musíme tak do funkce předat validní adresu na kus paměti, kde je opravdu uloženo celé číslo, což v tomto případě neplatí. Co vypíše následující program, pokud na vstup zadáme 5? #include <stdio.h> int main() { int a; scanf("%s", &a); printf("Hodnota: %d\n", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Sice správně do funkce scanf předává adresu proměnné, ale špatného typu. Zástupný znak %s vyžaduje adresu (pole) znaků, zatímco zde předáváme adresu celého čísla. Co vypíše následující program, pokud na vstup zadáme Martin\nNovak? #include <stdio.h> int main() { char radek[100]; fgets(radek, sizeof(radek), stdin); const char* jmeno = radek; fgets(radek, sizeof(radek), stdin); const char* prijmeni = radek; printf("%s", jmeno); printf("%s", prijmeni); return 0;
} Odpověď Vypíše se tohle: Novak
Novak Je důležité si uvědomit, co znamená const char* jmeno = radek;. char* je ukazatel, tedy číslo obsahující adresu. Tímto řádkem pouze říkáme, že do ukazatele s názvem jmeno ukládáme adresu pole znaků radek. Řádkem const char* prijmeni = radek; říkáme, že tuto adresu ukládáme do proměnné s názvem prijmeni. Obě dvě proměnné (jmeno a prijmeni) tedy obsahují stejnou adresu. No a jelikož si druhým voláním funkce fgets přepíšeme původní obsah pole radek, a obě proměnné ukazují na pole radek, tak se vypíše dvakrát poslední načtený řádek. Poznámka: ve formátovacím řetězci funkce printf jsme zde nepoužili znak odřádkování (\n), protože funkce fgets jej uloží do pole radek a náš kód ho zde neodstranil. Takže pokud bychom ho měli i v printf, tak by se vypsaly dva znaky odřádkování za sebou.

