K výpisu formátovaného textu na stdout můžeme použít funkci printf, s kterou jsme se již mnohokrát setkali. Prvním parametrem funkce je formátovací řetězec, do kterého můžete dávat zástupné znaky začínající procentem (např. %d nebo %s). Pro každý takovýto zástupný znak funkce bude očekávat jednu hodnotu (argument) za formátovacím řetězcem, která bude zformátována na výstup. Například takto můžeme vytisknout číslo a po něm řetězec: const char* text = "Cislo";
int cislo = 5;
printf("Cislo %d, retezec %s: \n", cislo, text); Jelikož jsme ve formátovacím řetězci předali dva zástupné znaky (%d - číslo a %s - řetězec), tak po řetězci musíme do funkce printf předat jeden argument číselného typu, a poté jeden řetězec. Zástupné znaky funkcí printf i scanf jsou obdobné, jejich seznam a různé možnosti nastavení můžete najít v dokumentaci . Nejčastěji budeme používat tyto zástupné znaky: %d - výpis celého čísla se znaménkem, nejčastěji datový typ int %f - výpis desetinného čísla, datový typ float %s - výpis řetězce, datový typ char* (ukazatel na znak) Na předané adrese musí ležet řetězec, tj. pole znaků ukončené znakem '\0' ! Stejně jako scanf má i funkce printf různé varianty pro formátovaný výpis do souborů (fprintf) či do řetězce v paměti (sprintf). Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { int a = 1; printf("Hodnota: %f", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Říkáme funkci printf, že chceme vypsat desetinné číslo (zástupný znak %f), ale jako argument předáváme výraz typu celé číslo (int). Tento program tedy není validní. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; printf("Hodnota: %d (a=%d)", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Říkáme funkci printf, že jí předáme dvě hodnoty (dva výrazy) typu celého čísla (zástupný znak %d), ale předáváme pouze jednu hodnotu (a). Tento program tedy není validní. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; printf("Hodnota: %s", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Říkáme funkci printf, že jí předáme hodnotu typu řetězec (zástupný znak %s), ale předáváme pouze hodnotu typu celé číslo (int). Tento program tedy není validní.

