Možná vás napadlo, že psát při každém použití struktury klíčové slovo struct před jejím názvem je zdlouhavé. C umožňuje dávat datovým typům nové názvy, aby se nám s nimi lépe pracovalo. Lze toho dosáhnout pomocí syntaxe typedef <datový typ> <jméno>;: typedef int teplota; int main() { teplota venkovni = 24; return 0;
} Pomocí typedef vytvoříme nové jméno pro datový typ, pomocí kterého se pak na tento typ můžeme odkazovat (původní název datového typu to však nijak neovlivní a můžeme ho stále používat). Opět platí, že takto vytvořené jméno lze použít pouze v oblasti ( scopu ), kde byl typedef použit. Obvykle se používá na nejvyšší úrovni souboru. U struktur si pomocí typedef můžeme zkrátit jejich název, typicky ze struct <nazev> na <nazev>: struct Osoba { int vek;
}; typedef struct Osoba Osoba; int main() { Osoba jiri; return 0;
} Toto lze ještě více zkrátit, pokud deklaraci struktury použijeme přímo na místě datového typu v typedef: typedef struct Osoba { int vek;
} Osoba; A konečně, abychom nemuseli jméno struktury opakovat dvakrát, můžeme vytvořit tzv. anonymní strukturu ( anonymous structure ) bez názvu, a jméno jí přiřadit až pomocí typedef. typedef struct { int vek;
} Osoba; Právě takto se obvykle deklarují struktury v C .

