Zarovnání jednotlivých datových typů ovlivňuje to, jak překladač rozmístí jednotlivé členy struktur v paměti. Bude se totiž snažit o to, aby každý člen struktury ležel na adrese, která bude zarovnaná vzhledem k datovému typu daného členu. Vezměme si například následující strukturu: Poznámka: ve všech případech níže budeme předpokládat, že short zabírá 2 byty, int zabírá 4 byty, a ukazatel zabírá 8 bytů. typedef struct { char a; int b;
} Str1; Jelikož char zabírá 1 byte a int zabírá 4 byty, mohli bychom si myslet, že sizeof(Str1) bude 5. Nicméně překladač musí zajistit, že člen b bude ležet na adrese, která bude zarovnaná na 4 byty, protože zarovnání datového typu int je 4. Dejme tomu, že by proměnná typu Str1 ležela třeba na adrese 16, tj. i člen a by ležel na adrese 16. Pokud by překladač umístil člen b na adresu 17, tak by tento člen ležel na nezarovnané adrese [1] : str1-packed Každá čtvercová buňka reprezentuje jeden byte. V pravém horním rohu buňky je znázorněna adresa buňky. Šedé buňky označují byty paddingu . Čerchované buňky obsahují nezarovnaná data. Z tohoto důvodu překladač vloží za a tři byty tzv. výplně ( padding ). Tyto byty nebudou k ničemu využívány, budou sloužit pouze k tomu, aby byl člen b správně zarovnaný. Struktura tedy bude v paměti uložena takto, její velikost bude 8 bytů a její zarovnání budou 4 byty: str1-unpacked Překladač ovšem nevkládá výplň pouze mezi jednotlivé členy struktur. Někdy musí vložit výplň i na samotný konec struktury. Podívejme se na následující strukturu Str2: typedef struct { int b; char a;
} Str2; Mohlo by se zdát, že zde být výplň být nemusí, protože int může ležet "na začátku" struktury, a char má zarovnání 1, takže může ležet kdekoliv. Co by se ovšem stalo, kdybychom tyto struktury uložili za sebe do paměti v poli? str2-packed První struktura v poli by byla zarovnaná správně, ale druhá (případně ty další) už ne! Z toho důvodu musí překladač zajistit, že budou správně zarovnaní nejenom všichni členové struktury, ale i struktura samotná. Zarovnání struktury se rovná nejvyššímu zarovnání ze všech členů struktury, v tomto případě to bude 4. Překladač tak musí zajistit, aby všechny struktury Str2 (i když budou ležet v poli za sebou) ležely na adresách, které budou násobky 4. Z tohoto důvodu zde překladač vloží 3 byty výplně i na konec struktury, aby byly proměnné této struktury správně zarovnané: str2-unpacked

