Pro čtení ze souboru můžeme použít funkci fread , která je protikladem funkce fwrite: size_t fread( void* buffer, // adresa, na kterou zapíšeme data ze souboru size_t size, // velikost prvku, který načítáme size_t count, // počet prvků, které načítáme FILE* stream // soubor, ze kterého čteme
); Tato funkce opět předpokládá, že budeme ze souboru načítat několik hodnot stejného datového typu. Například načtení pěti celých čísel, které jsme zapsali v kódu zde , by mohlo vypadat následovně: #include <stdio.h>
#include <assert.h> int main() { int pole[5] = { 1, 2, 3, 4, 5 }; // otevření souboru FILE* soubor = fopen("soubor", "rb"); assert(soubor); // čtení ze souboru int precteno = fread(pole, sizeof(int), 5, soubor); assert(precteno == 5); // zavření souboru fclose(soubor); return 0;
} Funkce fread vrací počet prvků, které úspěšně načetla ze souboru.

235.body:
Při čtení ze souboru je třeba vyřešit jednu dodatečnou věc – jak rozpoznáme, že už jsme soubor přečetli celý a už v něm nic dalšího nezbývá? Pokud načítáme data ze souboru "binárně", tj. interpretujeme je jako byty a ne jako (ASCII) text, obvykle stačí si velikost souboru předpočítat po jeho otevření pomocí funkcí ftell a fseek nebo si ji přečíst přímo ze samotného souboru [2] . Spousta binárních formátů (např. JPEG) jsou tzv. samo-popisné ( self-describing ), což znamená, že typicky na začátku souboru je v pevně stanoveném formátu (tzv. hlavičce ) uvedeno, jak je daný soubor velký. Využijeme toho například při práci s obrázkovým formátem TGA . Co ale dělat, když načítáme textové soubory, jejichž formát obvykle není ani zdaleka pevně daný? Předpočítat si velikost souboru a pak muset po každém načtení např. řádku počítat, kolik znaků jsme vlastně načetli, by bylo relativně komplikované. Při čtení textových souborů se tak obvykle využívá jiná strategie – čteme ze souboru tak dlouho, dokud nedojde k chybě. Způsob detekce chyby záleží na použité funkci: fscanf vrátí číslo <= 0, pokud se jí nepodaří načíst žádný zástupný znak ze vstupu. fgets vrátí ukazatel s hodnotou 0, pokud dojde k chybě při čtení. Jakmile dojde k chybě, tak bychom ještě měli ověřit, jestli jsme opravdu na konci souboru, anebo byla chyba způsobena něčím jiným [3] . To můžeme zjistit pomocí funkcí feof , která vrátí nenulovou hodnotu, pokud jsme se před jejím zavoláním pokusili o čtení a pozice již byla na konci souboru, a ferror , která vrátí nenulovou hodnotu, pokud došlo k nějaké jiné chybě při práci se souborem. Například pokud čteme soubor z USB flashky, který je během čtení odpojen od počítače. Program, který by načítal a rovnou vypisoval řádky textu ze vstupního souboru, dokud nedojde na jeho konec, by tedy mohl vypadat například takto: #include <assert.h>
#include <errno.h>
#include <stdio.h>
#include <string.h> int main() { FILE* soubor = fopen("soubor.txt", "rt"); assert(soubor); char radek[80]; while (1) { if (fgets(radek, sizeof(radek), soubor)) { // radek byl uspesne nacten printf("Nacteny radek: %s", radek); } else { if (feof(soubor)) { printf("Dosli jsme na konec souboru\n"); } else if (ferror(soubor)) { printf("Pri cteni ze souboru doslo k chybe: %s\n", strerror(errno)); } break; } } fclose(soubor); return 0;
} Kvíz 🤔 Co vypíše následující program za předpokladu, že v souboru soubor.txt je tento obsah? radek1
radek2
radek3 #include <stdio.h>
#include <assert.h> int main() { FILE* soubor = fopen("soubor.txt", "r"); assert(soubor); char radek[80]; while (feof(soubor) == false) { fgets(radek, sizeof(radek), soubor); printf("Nacteny radek: %s", radek); } fclose(soubor); return 0;
} Odpověď Program vypíše: radek1
radek2
radek3
radek3 Funkce feof vrátí pravdivou hodnotu pouze tehdy, kdy před jejím zavoláním na daném souborovém deskriptoru došlo k pokusu o čtení, který selhal z důvodu konce vstupního souboru. Po načtení prvních tří řádků tedy feof vrátí false, protože poslední pokus o čtení uspěl. Až v momentě, kdy se pokusíme načíst čtvrtý řádek, tak funkce fgets selže a poté feof vrátí true. Jelikož ale tento kód nekontroluje návratovou hodnotu funkce fgets a vždy po pokusu o načtení řádku vypíše proměnnou radek, tak se poslední řádek souboru vypíše dvakrát.

240.body:
Nyní už víme, jak přeložit program skládající se z více jednotek překladu (zdrojových souborů) a následně tyto jednotky spojit dohromady pomocí linkeru. V této sekci si ukážeme, jak můžeme použít kód, který existuje v jiném zdrojovém souboru. Pokud chceme zavolat funkci, kterou jsme napsali v jiném souboru, můžeme ji prostě zavolat a linker se postará o zbytek: // soubor1.c
int main() { moje_funkce(); return 0;
} // soubor2.c
void moje_funkce() {} Pokud tyto dva soubory přeložíme a poté slinkujeme, tak se zavolá správná funkce: $ gcc -c soubor1.c
$ gcc -c soubor2.c
$ gcc soubor1.o soubor2.o -o program Nicméně, pokud bychom používali kód z jiných souborů takto "naslepo", narazili bychom na několik problémů. Tím, že překladač v souboru soubor1.c nemá přístup k signatuře funkce moje_funkce, tak nemůže ověřit, jestli jsme jí předali správný počet argumentů se správnými datovými typy, a ani neví, jaký je datový typ návratové hodnoty této funkce. Kód "naslepo" navíc nebude vůbec fungovat pro použití (globálních) proměnných. Při pokusu o použití neexistující proměnné by překladač totiž rovnou ohlásil chybu.

242.body:
Z historických důvodů překladače C fungují v tzv. jednoprůchodovém režimu ( one-pass compilation ). Znamená to, že překladač "čte" náš zdrojový kód shora dolů, a v momentě, kdy chceme například použít nějakou funkci nebo proměnnou, tak již překladač dříve musel vidět (alespoň) její deklaraci, popř. rovnou i definici. Například v následujícím programu: void funkce1() { funkce2();
}
void funkce2() {} si překladač bude stěžovat na to, že na řádku 2 nezná funkci funkce2, protože tato funkce je v souboru nadefinovaná až po funkci funkce1, která ji používá: test.c: In function ‘funkce’:
test.c:2:5: warning: implicit declaration of function ‘funkce2’; 2 | funkce2(); Pokud tedy potřebujeme nadefinovat funkci na pozdějším místě, než je její první použití, můžeme nejprve vytvořit její deklaraci a až později (popř. v úplně jiném souboru) vytvořit její definici: void funkce2(); // deklarace void funkce1() { funkce2(); // použití
}
void funkce2() {} // definice Takovýto program už se přeloží bez varování. Koncept deklarování funkcí či proměnných v jednoprůchodových překladačích se nazývá dopředná deklarace ( forward declaration ).

243.body:
V C platí tzv. pravidlo jedné definice ( one definition rule ). Každá proměnná i funkce musí být v programu nadefinována právě jednou (deklarována může být vícekrát). To platí jak v rámci jednoho souboru, tak v rámci celého programu (tj. napříč všemi zdrojovými soubory). Pokud bychom proměnnou či funkci pouze nadeklarovali a/nebo použili bez definice: // soubor.c
void funkce(); int main() { funkce(); return 0;
} Tak by kompilace selhala v době linkování, protože by nenašel žádnou funkci/proměnnou, kterou by mohl použít: $ gcc -c soubor.c
$ gcc soubor.o
/usr/bin/ld: test.o: in function `main':
test.c:(.text+0xe): undefined reference to `funkce'
collect2: error: ld returned 1 exit status Pokud bychom naopak nadefinovali proměnnou či funkci více než jednou: // soubor1.c
void funkce() {} int main() { funkce(); return 0;
}
// soubor2.c
void funkce() {} Tak by linkování opět selhalo, protože by linker nevěděl, kterou definici použít: $ gcc -c soubor1.c
$ gcc -c soubor2.c
$ gcc soubor1.o soubor2.o
/usr/bin/ld: soubor2.o: in function `funkce':
soubor2.c:(.text+0x0): multiple definition of `funkce'; test.o:test.c:(.text+0x0): first defined here
collect2: error: ld returned 1 exit status

244.body:
Z jiných souborů lze používat pouze funkce a proměnné, které jsou veřejné . Implicitně jsou všechny funkce i všechny globální proměnné veřejné. Pokud byste chtěli zamezit tomu, aby mohly ostatní soubory používat nějakou funkci nebo globální proměnnou, můžete ji označit klíčovým slovem static, abyste z nich udělali soukromé funkce či proměnné: static void soukroma_funkce() {}
static int soukroma_promenna; Takovéto funkce a proměnné půjde používat pouze v souboru, ve kterém byly nadefinovány. Doporučujeme static používat pro označení proměnných a funkcí, které nechcete sdílet se zbytkem programu. Půjde tak na první pohled poznat, které funkce jsou určeny k použití z jiných souborů a které ne [2] . Použití static také může v určitých případech vést k vygenerování efektivnějšího kódu a menší velikosti výsledného spustitelného souboru. Klíčové slovo static lze také použít u lokálních proměnných, zde má ovšem úplně jiný význam než u globálních proměnných! Použití static u lokální proměnné z ní udělá proměnnou uloženou v globální paměti . Takováto proměnná se nainicializuje, když se program poprvé dostane k řádku s její definicí. Proměnná bude existovat po celou dobu běhu programu a udrží si svou hodnotu i po skončení volání funkce: #include <stdio.h> void test() { static int x = 0; x += 1; printf("%d\n", x);
} int main() { test(); test(); return 0;
}

245.body:
Nyní už víme, že pro použití kódu z jiných souborů bychom nejprve měli dané funkce a proměnné deklarovat . Pokud bychom však museli v každém souboru, ve kterém chceme použít kód z jiného souboru, museli vytvářet deklarace pro každou funkci či proměnnou, kterou chceme použít, bylo by to docela zdlouhavé. Pokud by navíc došlo ke změně datového typu či názvu takovéto sdílené funkce či proměnné, museli bychom deklarace upravit ve všech souborech, kde funkci či proměnnou používáme. Pro vyřešení tohoto problému se v C často využívá koncept tzv. hlavičkových souborů ( header files ). Pro každý zdrojový soubor, jehož kód chceme sdílet, vytvoříme hlavičkový soubor, který bude obsahovat deklarace všech sdílených veřejných funkcí a globálních proměnných z daného zdrojového souboru. Ve zdrojovém souboru pak budou jejich definice. Dle jmenné konvence se hlavičkový soubor pojmenovává jako <název zdrojového souboru>.h: // soubor.h (deklarace)
int moje_funkce();
extern int moje_promenna; // soubor.c (definice)
int moje_funkce() {}
int moje_promenna; Hlavičkový soubor tak udává tzv. rozhraní ( interface ) odpovídajícího zdrojového souboru – obsahuje seznam funkcí a proměnných, které jsou sdílené a zbytek programu je může používat. Ostatní soubory, které chtějí funkce z nějakého zdrojového souboru použít, pak vloží jeho hlavičkový soubor pomocí preprocesoru, aby mohly používat sdílené funkce a globální proměnné s korektní kontrolou datových typů: // main.c
#include "soubor.h" int main() { moje_funkce(); int x = moje_promenna; return 0;
} Pokud dojde ke změně signatury funkce či typu/názvu proměnné, tak stačí změnu udělat v hlavičkovém (a odpovídajícím zdrojovém) souboru. Všechny ostatní soubory, které danou funkci nebo proměnnou používají, pak budou okamžitě využívat upravenou deklaraci díky použití #include. S hlavičkovými soubory jsme již setkali při použití standardní knihovny . V souborech jako je stdio.h se nacházejí deklarace funkcí jako je například printf, jejichž definice je poté obsažena v objektových souborech standardní knihovny.

246.body:
Jelikož hlavičkové soubory jsou určeny k tomu, aby byly využívány (vkládány) v různých zdrojových souborech, tak se jejich obsah přirozeně může vyskytnout ve více jednotkách překladu. Aby tak nebylo porušeno pravidlo jedné definice , je důležité do hlavičkových souborů dávat pouze deklarace, a ne definice funkcí a proměnných! Pokud byste do hlavičkového souboru dali například definici funkce, a tento soubor by se vyskytnul ve více jednotkách překladu, tak by linkování selhalo kvůli vícenásobné definici. Pokud byste přecejenom opravdu chtěli definici nějaké funkce "propašovat" do hlavičkového souboru, můžete před ní použít klíčové slovo inline: // soubor.h
inline void moje_funkce() { ... } Tímto klíčovým slovem slibujete linkeru, že všechny definice funkce s tímto názvem jsou stejné. Pokud tak linker narazí na definici této funkce vícekrát (což nastane, když tento hlavičkový soubor bude vložen ve více jednotkách překladu), tak nebude hlásit chybu, ale prostě si jednu z těchto definicí vybere. Pokud by definice stejné nebyly, může to vést k nedefinovanému chování 💣. Pokuste se tak inline raději nevyužívat. U (globálních) proměnných nemá smysl inline používat. Kromě deklarací funkcí a proměnných se do hlavičkových souborů také běžně vkládají struktury, které jsou součástí typů sdílených proměnných či parametrů a návratových hodnot sdílených funkcí. Aby mohly zdrojové soubory používat sdílené struktury i sdílené funkce v libovolném pořadí , tak obvykle zdrojové soubory vkládají svůj vlastní hlavičkový soubor: // soubor.h
typedef struct { int vek;
} Osoba; int zpracuj_osobu(Osoba osoba); // soubor.c
#include "soubor.h"
int zpracuj_osobu(Osoba osoba) { ... } Pro použití struktur nebo např. typedefů z ostatních souborů je také běžné, že hlavičkové soubory vkládají jiné hlavičkové soubory.

247.body:
U hlavičkových souborů je nutné řešit ještě jednu další věc. Jelikož se běžně používají v kombinaci s #include, může se stát, že i v rámci jedné jednotky překladu se jeden hlavičkový soubor vloží do výsledného zdrojového souboru více než jednou. To může způsobovat různé typy problémů: Pokud se budou hlavičkové soubory vkládat navzájem, mohlo by dojít k cyklické závislosti. Například zde by překlad selhal, protože by se hlavičkové soubory snažili vložit se navzájem donekonečna: // a.h
#include "b.h" // b.h
#include "a.h" Hlavičkový soubor se zbytečně vícekrát načítá překladačem, což prodlužuje dobu překladu. Pokud by hlavičkový soubor obsahoval nějakou definici, tak i kdyby byl použit pouze v jedné jednotce překladu, došlo by k chybě při linkování, protože by definice byla zduplikovaná. Abychom těmto situacím zamezili, tak u hlavičkových souborů budeme používat tzv. ochranu vkládání ( include guard ). Pomocí ochrany vkládání zajistíme, že jeden hlavičkový soubor se v rámci jedné jednotky překladu vloží maximálně jednou. Zamezení vícenásobného vložení můžeme dosáhnout pomocí podmíněného překladu : // soubor.h
#ifndef SOUBOR_H
#define SOUBOR_H void moje_funkce(); #endif Tohle je nicméně trochu zdlouhavé. Moderní překladače obsahují mnohem jednodušší způsob. Na začátek hlavičkového souboru stačí vždy vložit řádek #pragma once a dál nemusíte nic řešit: // soubor.h
#pragma once void moje_funkce();

264.body:
Jednotlivé části z hlavičky bychom mohli načítat byte po bytu, nicméně to by bylo dosti nepraktické. V případě, že formát, který chceme načíst, má pevně dané rozložení bytů, je mnohem jednodušší nadefinovat si strukturu , která bude danému rozložení odpovídat, a poté celou strukturu načíst ze souboru najednou. Jednotlivé hodnoty v hlavičce jsou reprezentovány byty bez znaménka. Jelikož tento datový typ v C má trochu zdlouhavý název, vytvořme si pro něj nejprve nové jméno byte: typedef unsigned char byte; Nyní si vytvořme strukturu, která bude reprezentovat TGA hlavičku. Jednotlivé atributy struktury musí přesně odpovídat hodnotám v hlavičce a musí být také uvedeny ve stejném pořadí: typedef struct { byte id_length; byte color_map_type; byte image_type; byte color_map[5]; byte x_origin[2]; byte y_origin[2]; byte width[2]; byte height[2]; byte depth; byte descriptor;
} TGAHeader; Možná vám přijde zvláštní, proč např. šířku definujeme jako pole dvou bytů namísto použití "dvou-bajtového celého čísla", např. datového typu uint16_t. Děláme to, aby do této struktury překladač nevložil žádné mezery . Pokud by je tam vložil, tak by naše struktura v paměti už neodpovídala hlavičce TGA v souboru a četli bychom tak neplatné hodnoty. Když použijeme pro všechny atributy datový typ s velikostí 1 byte, tak překladač žádné mezery vkládat nebude. Alternativním řešením by bylo říct překladači, ať do dané struktury žádné mezery nevkládá . Nyní už stačí pouze otevřít nějaký TGA soubor (např. tento ), načíst z něj počet bytů odpovídající naší struktuře a poté si z ní můžeme přečíst informace o daném obrázku: #include <stdio.h>
#include <assert.h> int main() { FILE* file = fopen("carmack.tga", "rb"); assert(file); TGAHeader header = {}; assert(fread(&header, sizeof(TGAHeader), 1, file) == 1); printf("Image type: %d, pixel depth: %d\n", header.image_type, header.depth); return 0;
} Pokud budeme chtít pracovat s hodnotami rozměrů, musíme je nejprve převést z pole bytů na celé číslo. Toho můžeme dosáhnout pomocí funkce memcpy : int width = 0;
int height = 0; memcpy(&width, header->width, 2);
memcpy(&height, header->height, 2); Datový typ int sice velmi pravděpodobně bude mít více bytů, než 2 (pravděpodobně bude mít 4 byty), ale jelikož v paměti i v souboru jsou data uložena ve formátu "little-endian", tak stačí do intu načíst dva byty, a bude to fungovat tak, jak očekáváme. Musíme však nejprve proměnnou intu inicializovat na nulu, jinak by vyšší dva byty měly nedefinovanou hodnotu!

265.body:
Jakmile jsme načetli hlavičku, můžeme načíst ze souboru i samotné pixely. Ty jsou umístěny v souboru hned za hlavičkou, řádek po řádku, zleva doprava a shora dolů. To znamená, že pixel v levém horním rohu obrázku je v souboru uložen jako první, tj. hned za hlavičkou, zatímco pixel v pravém dolním rohu obrázku je v souboru uložen jako poslední, na úplném konci souboru. Každý pixel má odpovídající počet bytů podle typu obrázku (u RGB obrázků 3 byty [1] , u obrázků ve stupních šedi 1 byte) a celkový počet pixelů je poté dán rozměry obrázku (šířka * výška). V TGA jsou jednotlivé barevné složky uložené v pořadí blue, green, red. Jedná se tedy vlastně o formát BGR. Můžeme si tak vytvořit pole pro pixely a načíst je z obrázku. Pro RGB obrázky by načtení pixelů mohlo vypadat např. takto: typedef struct { byte blue; byte green; byte red;
} Pixel; Pixel* load_pixels(TGAHeader header, FILE* file) { int width = 0; int height = 0; memcpy(&width, header.width, 2); memcpy(&height, header.height, 2); Pixel* pixels = (Pixel*) malloc(sizeof(Pixel) * width * height); assert(fread(pixels, sizeof(Pixel) * width * height, 1, file) == 1); return pixels;
}

