Jakmile máme načtené pixely v mřížce (poli pixelů) v paměti, tak s nimi můžeme pracovat jako s vícerozměrným polem . Pokud bychom například prošli všechny hodnoty pixelů, a nastavili jejich barevnou složku red (reprezentující červenou barvu) na hodnotu 0, tak z obrázku zcela odstraníme červenou barvu: Pixel* pixels = load_pixels(header, file);
for (int row = 0; row < height; row++) { for (int col = 0; col < width; col++) { Pixel* pixel = pixels + (row * width + col); pixel->red = 0; }
