Abychom něco vykreslili, tak jako první věc musíme nainicializovat SDL a vytvořit okno [2] : Pro zpřehlednění kódu bude v ukázkách níže vynechána kontrola chyb. Celý program i s kontrolou chyb naleznete na konci této sekce. // Vložení hlavního hlavičkového souboru SDL
#include <SDL2/SDL.h> int main(int argc, char *argv[])
{ // Inicializace SDL SDL_Init(SDL_INIT_VIDEO); // Vytvoření okna SDL_Window* window = SDL_CreateWindow( "SDL experiments", // Titulek okna 100, // Souřadnice x 100, // Souřadnice y 800, // Šířka 600, // Výška SDL_WINDOW_SHOWN // Okno se má po vytvoření rovnou zobrazit ); Jakmile máme otevřené okno, můžeme do něj něco začít vykreslovat. K tomu musíme nejprve vytvořit SDL_Renderer, neboli kreslítko: // Vytvoření kreslítka SDL_Renderer* renderer = SDL_CreateRenderer( window, -1, SDL_RENDERER_ACCELERATED | SDL_RENDERER_PRESENTVSYNC ); S kreslítkem už můžeme něco nakreslit na obrazovku. Musíme vytvořit tzv. herní smyčku ( game loop ), která se bude provádět neustále dokola. Ve smyčce nejprve získáme události, které nastaly (např. došlo ke stisknutí klávesy nebo pohybu myši), poté je zpracujeme, vykreslíme nový obsah okna a odešleme jej k vykreslení (za použití tzv. double bufferingu ). Konkrétně budeme vykreslovat jednoduchou posouvající se čáru, dokud uživatel nezavře otevřené okno: SDL_Event event; int running = 1; int line_x = 100; while (running == 1) { // Dokud jsou k dispozici nějaké události, ukládej je do proměnné `event` while (SDL_PollEvent(&event)) { // Pokud došlo k uzavření okna, nastav proměnnou `running` na `0` if (event.type == SDL_QUIT) { running = 0; } } // Posuň pozici čáry doprava line_x++; // Nastav barvu vykreslování na černou SDL_SetRenderDrawColor(renderer, 0, 0, 0, 255); // Vykresli pozadí SDL_RenderClear(renderer); // Nastav barvu vykreslování na červenou SDL_SetRenderDrawColor(renderer, 255, 0, 0, 255); // Vykresli čáru SDL_RenderDrawLine(renderer, line_x, 50, line_x, 250); // Zobraz vykreslené prvky na obrazovku SDL_RenderPresent(renderer); } A na konci už akorát vše uvolníme: // Uvolnění prostředků SDL_DestroyRenderer(renderer); SDL_DestroyWindow(window); SDL_Quit(); return 0;
} Pokud spustíte program využívající SDL s Address sanitizerem, může se stát, že vám sanitizer zobrazí nějakou neuvolněnou paměť . Pokud zdroj alokace nepochází z vašeho kódu, můžete tyto chyby ignorovat. Tyto chyby pochází přímo z SDL a nemáte se jich jak zbavit. Celý kód i s ošetřením chyb #include <SDL2/SDL.h> int main(int argc, char *argv[])
{ if (SDL_Init(SDL_INIT_VIDEO)) { fprintf(stderr, "SDL_Init Error: %s\n", SDL_GetError()); return 1; } SDL_Window* window = SDL_CreateWindow("SDL experiments", 100, 100, 800, 600, SDL_WINDOW_SHOWN); if (!window) { fprintf(stderr, "SDL_CreateWindow Error: %s\n", SDL_GetError()); SDL_Quit(); return 1; } SDL_Renderer* renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED | SDL_RENDERER_PRESENTVSYNC); if (!renderer) { SDL_DestroyWindow(window); fprintf(stderr, "SDL_CreateRenderer Error: %s", SDL_GetError()); SDL_Quit(); return 1; } int line_x = 100; SDL_Event event; int running = 1; while (running == 1) { while (SDL_PollEvent(&event)) { if (event.type == SDL_QUIT) { running = 0; } } line_x++; SDL_SetRenderDrawColor(renderer, 0, 0, 0, 255); // Nastavení barvy na černou SDL_RenderClear(renderer); // Vykreslení pozadí SDL_SetRenderDrawColor(renderer, 255, 0, 0, 255); // Nastavení barvy na červenou SDL_RenderDrawLine(renderer, line_x, 50, line_x, 250); // Vykreslení čáry SDL_RenderPresent(renderer); // Prezentace kreslítka } SDL_DestroyRenderer(renderer); SDL_DestroyWindow(window); SDL_Quit(); return 0;
}

