Pokud byste si chtěli nastavit VS Code tak, aby překládal nebo spouštěl váš program s jiným, než základním nastavením, můžete k tomu využít konfiguraci pomocí souborů launch.json, který definuje, jak bude VS Code váš program spouštět, případně tasks.json, pomocí kterého můžeme nastavit, jak se bude program překládat. launch.json je možno vytvořit po kliknutí na záložku Run and Debug (Ctrl+Shift+D) a poté na tlačítko create a launch.json file (tlačítko se zobrazí, pokud máte otevřený soubor s příponou .c ve VS Code). Soubor se vytvoří v současně otevřeném adresáři, ve složce .vscode (můžete ho případně i vytvořit manuálně). Do vygenerovaného souboru můžete zkopírovat tento obsah: { "version": "0.2.0", "configurations": [ { "name": "C program (gdb) Launch", "type": "cppdbg", "request": "launch", "program": "${workspaceFolder}/main", "args": [], "cwd": "${workspaceFolder}", "MIMode": "gdb", "miDebuggerPath": "/usr/bin/gdb", "preLaunchTask": "C compile" } ]
} Atributy této konfigurace poté můžete upravovat. Užitečné pro vás budou zejména tyto atributy: program - cesta ke spustitelnému (přeloženému) souboru, který bude konfigurace spouštět cwd - pracovní adresář, ve kterém se program spustí args - argumenty příkazového řádku předané spouštěnému programu Pokud byste si chtěli při ladění přesměrovat obsah souboru na standardní vstup programu, tak přidejte na konec args šipku doleva a cestu k souboru, který chcete přesměrovat na vstup: "args": [ "<", "${workspaceFolder}/stdin_file.stdin"
] Dále budete muset nastavit soubor tasks.json , pro automatický překlad programu (vytvořte jej opět ve .vscode složce projektu). Pokud tento soubor bude chybět, při pokusu o ladění programu dostanete chybovou hlášku podobnou této: launch: program <cesta>/main does not exist Do tasks.json si můžete zkopírovat tento obsah: { "version": "2.0.0", "tasks": [ { "type": "cppbuild", "label": "C compile", "command": "gcc", "args": [ "${workspaceFolder}/main.c", "-g", "-o", "${workspaceFolder}/main" ] } ]
} Zde jsou důležité hlavně dva atributy: label - název tasku pro spuštění. Tento název musí odpovídat atributu preLaunchTask v souboru launch.json . args - parametry překladače použité při překladu. Prvním argumentem by měla být cesta k překládanému C zdrojovému souboru. Dále by v args měla být cesta k výslednému přeloženého souboru, předaná za parametrem -o. Tato cesta musí odpovídat atributu program v souboru launch.json . Dále zde můžete předávat další parametry překladače, např. zapnout Address sanitizer (-fsanitize=address) nebo přilinkovat nějaké knihovny (např. -lm). Více informací o možnostech nastavení těchto dvou souborů můžete naleznout na těchto odkazech: Microsoft Configure C/C++ debugging Microsoft Variables Reference

281.body:
Základem víceméně všech "real-time" počítačových her je tzv. herní smyčka. Jedná se o cyklus v programu, který se stará o aktualizaci stavu hry, a vykreslení jednoho tzv. snímku ( frame ) na obrazovku. Hry typicky fungují tak, že běží donekonečna v tomto cyklu (herní smyčce), a např. 60x za vteřinu aktualizují stav hry a poté jej vykreslí. Z toho také pochází pojem Snímků za vteřinu ( Frame per second , FPS ), který udává, jak často je hra schopná se vykreslit za vteřinu. Herní smyčku vytvoříme jednoduše jako cyklus, který poběží až do doby, než bude potřeba naši hru vypnout: int running = 1;
while (running == 1) { // Tělo herní smyčky
} V každé iteraci herní smyčky bychom měli provést následující činnosti (ideálně v tomto pořadí): Přečíst a zareagovat na události operačního systému Např. žádost o vypnutí aplikace, stisk klávesy, pohyb myši Aktualizovat stav hry v paměti Např. pohnout postavou či projektilem, aktualizovat čas cooldownu atd. Vykreslit aktuální stav hry na obrazovku

282.body:
Jako úplný základ bychom měli mít v herní smyčce čtení událostí operačního systému, které si můžeme přečíst pomocí volání funkce SDL_PollEvent . Do této funkce předáme adresu struktury SDL_Event , a pokud funkce vrátí hodnotu 1, tak došlo k nějaké události, a my si můžeme informaci o této události z předané struktury SDL_Event přečíst: SDL_Event event;
while (SDL_PollEvent(&event)) { // Pokud došlo k uzavření okna, nastav proměnnou `running` na `0` if (event.type == SDL_QUIT) { running = 0; }
} Pokud dojde k události SQL_QUIT, tak se uživatel snaží naši aplikaci vypnout (např. kliknutím na ikonku křížku v rohu okna aplikace). Na tuto událost bychom měli zareagovat tak, že náš program (hru) vypneme. [1] Pokud bychom tak neudělali, tak se aplikace "zasekne", a zobrazí se nechvalně známý dialog operačního systému o neresponzivní aplikaci. Při kontrole událostí budeme chtít typicky reagovat na vstup uživatele z klávesnice či myši. Více o zpracování vstupu se můžete dozvědět zde .

283.body:
Při aktualizaci stavu hry a provádění jakéhokoliv pohybu, rotace apod. bychom měli vždy brát v potaz kompenzaci FPS (snímků za vteřinu). Představte si, že v naší hře máme nějaký pohybující se objekt, který chceme posouvat v každém snímku hry o nějaký počet pixelů daným směrem: int position = 0;
while (running == 1) { // ... position += 1; SDL_RenderDrawLine(renderer, position, 100, position, 200); // ...
} V kódu výše posouváme v každé iteraci pozici čáry o jeden pixel. Co se v tomto případě stane, když naše aplikace bude mít 60 FPS? Čára se za jednu vteřinu posune o 60 pixelů. Pokud by naše aplikace měla ale např. pouze 20 FPS, tak se čára posune pouze o 20 pixelů! A kdyby měla 1000 FPS, tak se naopak posune o celých 1000 pixelů. Pokud by logika her závisela na počtu FPS, tak by to jistě způsobovalo problémy. Představte si například, že v hrách, jako je Call of Duty nebo Counter-Strike, by počet FPS ovlivňoval, jak rychle postava poběží nebo jak rychle se budou pohybovat projektily, které postava vystřelí. S takovýmto řešením by hráči ani autoři hry určitě nebyli spokojeni. Ideálně bychom chtěli, aby se v naší hře vše pohybovalo stanovenou rychlostí, nezávisle na současné hodnotě FPS. Toho můžeme dosáhnout pomocí tzv. delta času ( delta time ). Delta je označení pro čas vykonání jedné iterace herní smyčky. Čím více bude mít naše hra FPS, tím menší bude delta: Při 60 FPS je delta ~0.016 s, neboli ~16 ms Při 10 FPS je delta ~0.1 s, neboli ~100 ms Při 1 FPS je delta ~1 s, neboli ~1000 ms Deltu můžeme vypočítat pomocí funkcí na měření času nabízených knihovnou SDL: // Uložení poslední hodnoty čítače
Uint64 last = SDL_GetPerformanceCounter(); while (running == 1) { // Zjištění současné hodnoty čítače Uint64 now = SDL_GetPerformanceCounter(); // Výpočet delty, času od posledního provedení tohoto řádku (tj. délky iterace herní smyčky) double deltaTime = (double)((now - last) / (double)SDL_GetPerformanceFrequency()); // Uložení poslední hodnoty čítače last = now; // ...
} Pokud si chcete naměřit a vypisovat hodnotu FPS své hry, stačí vypsat převrácenou hodnotu delty, tj. platí FPS = 1 / deltaTime. Jakmile máme k dispozici hodnotu delty, můžeme ji využít k tomu, abychom pohyb ve hře přizpůsobili počtu FPS. Toho dosáhneme tak, že budeme každý pohyb ve hře "škálovat" (neboli násobit) hodnotou delty: position += 100 * deltaTime; Když budeme mít hodně FPS (tj. malou hodnotu delty), tak budeme hýbat (a vykreslovat) objekty spoustakrát za vteřinu, takže chceme, aby objekty dělaly malé kroky, a hýbaly se plynule. V tomto případě bude delta mít malou hodnotu, takže pohyb se bude provádět po malých krocích. Pokud budeme mít naopak málo FPS (tj. velkou hodnotu delty), tak budeme hýbat objekty pouze několikrát za vteřinu, takže poté musí objekty udělat větší krok, aby urazily stejnou vzdálenost za stejnou časovou jednotku. V tomto případě bude delta mít velkou hodnotu, takže pohyb se bude provádět po velkých krocích. Tento princip si můžeme demonstrovat na následujících animaci, které zobrazují pohyb tří obdélníků s různým počtem snímků za vteřinu. První obdélník se pohybuje s 60 FPS, druhý obdélník s 10 FPS, a třetí obdélník s 1 FPS. Všimněte si, že za stejnou dobu všechny obdélníky urazí cca stejnou vzdálenost. Díky kompenzaci pohybu pomocí delta času jsou tak rychlosti obdélníků nezávislé na FPS. Nezapomeňte tak ve svých hrách všechny pohyby, rotace, animace, aktualizace času, cooldownů atd. násobit deltou! U násobení hodnot deltou je potřeba dát si pozor na jednu věc, a to jsou desetinná čísla. Pokud budeme mít např. pozici nějakého objektu ve hře reprezentovanou celým číslem (int), tak může dojít k problému se zaokrouhlováním. Pokud např. budeme chtít tento objekt posunout rychlostí 10, a budeme mít 60 FPS, tak 10 * 0.016 je 0.16, což se při převodu na int zaokrouhlí na hodnotu 0! Při násobení deltou bychom se tedy mohli dostat do situace, kdy se naše objekty vůbec nebudou hýbat, protože jednotlivé kroky budou moc malé na to, aby se vůbec na hodnotě celého čísla projevily. Proto se snažte reprezentovat veškeré pozice a podobné hodnoty, které musíte násobit deltou, pomocí desetinných čísel, tj. datových typů float nebo double.

290.body:
Nevyplněný obdélník můžete vykreslit pomocí funkce SDL_RenderDrawRect , vyplněný obdélník poté pomocí funkce SDL_RenderFillRect . Tyto funkce vyžadují předání adresy na hodnotu struktury SDL_Rect , která reprezentuje obdélník. Pro vykreslení obdélníku tedy nejprve musíme vytvořit proměnnou typu SDL_Rect, nastavit jí pozici a rozměry, a poté zavolat jednu z těchto dvou funkcí. SDL_Rect rect = { .x = 100, .y = 200, .w = 500, .h = 200
};
SDL_RenderFillRect(renderer, &rect); Datový typ SDL_Rect se hodí nejenom pro vykreslování obdélníků. Můžete jej použít také na reprezentaci pozice a rozměru různých objektů ve své hře. SDL také nabízí funkce pro kontrolu toho, jestli se dva obdélníky protínají, např. pomocí funkce SDL_HasIntersection . Díky tomu můžete použít tyto obdélníky také na detekci kolizí (např. na zjištění, jestli projektil trefil hráče). Datový typ SDL_Rect ukládá pozici a rozměry obdélníku pomocí datového typu int. Pokud byste potřebovali obdélník, kde tyto atributy budou reprezentované desetinnými čísly, můžete použít SDL_FRect .

291.body:
SDL má také samozřejmě podporu nejenom pro kreslení čar či obdélníků, ale také pro kreslení (bitmapových) obrázků (které můžeme načíst např. ze souborů ve formátu PNG nebo JPEG). Ke kreslení však budeme muset využít dodatečnou knihovnu zvanou SDL2_image, kterou poté musíme přilinkovat k našemu programu při překladu: $ gcc main.c -omain -lSDL2 -lSDL2_image Poté musíme na začátku souboru, kde chceme funkce pro načítání obrázků použít, vložit odpovídající hlavičkový soubor: #include <SDL2/SDL_image.h> Jakmile tohle uděláme, tak můžeme použít funkci IMG_LoadTexture , která bere jako parametr kreslítko, a cestu k souboru na disku, ze kterého se má načíst obrázek, který poté budeme vykreslovat: SDL_Texture* image = IMG_LoadTexture(renderer, "image.png"); Z funkce se nám vrátí ukazatel na strukturu SDL_Texture , která reprezentuje obrázek načtený v paměti grafické kartě, který je připravený k vykreslení. Při načítání obrázků (stejně jako jakýchkoliv jiných souborů) bychom si měli dát pozor na to, abychom k němu udali správnou cestu . Měli bychom také zkontrolovat, jestli se obrázek správně načetl, tj. jestli funkce nevrátila hodnotu NULL [1] . Kontrolu si můžeme usnadnit pomocí makra assert . Pokud by funkce vrátila NULL, a my bychom se poté snažili tuto hodnotu vykreslit jako obrázek, tak může dojít k nedefinovanému chování 💣. Proto bychom měli vždy kontrolovat návratovou hodnotu této funkce. Jakmile máme obrázek správně načtený, tak jej můžeme vykreslit pomocí funkce SDL_RenderCopy . Této funkci musíme předat kreslítko, obrázek, který chceme vykreslit a dva obdélníky (srcrect a dstrect). Parametr srcrect určuje výřez z obrázku, který chceme kreslit. Pokud chceme obrázek vykreslit celý, tak pro parametr srcrect předáme hodnotu NULL. Parametr dstrect určuje, do jakého výřezu (obdélníku v plátnu) se má obrázek vykreslit. Zde bychom si měli dát pozor, aby cílový obdélník měl stejný poměr stran, jako náš obrázek, jinak po vykreslení může být obrázek značně zdeformovaný. SDL_Rect rect = { .x = 100, .y = 100, .w = 400, .h = 400
};
SDL_RenderCopy(renderer, image, NULL, &rect); Užitečná je také funkce SDL_RenderCopyEx , která nám umožňuje vykreslit obrázek, který je zarotovaný, případně zrcadlený podél vertikální či horizontální osy. Jakmile přestaneme obrázek potřebovat, měli bychom jeho texturu uvolnit pomocí volání funkce SDL_DestroyTexture : SDL_DestroyTexture(image);

292.body:
Další užitečnou funkcionalitou, kterou nám SDL nabízí, a která je potřeba pro většinu her či grafických aplikací, je vykreslování textu. K tomu budeme opět vyžadovat dodatečnou knihovnu, která se jmenuje SDL2_ttf: $ gcc main.c -omain -lSDL2 -lSDL2_ttf Pro práci s touto knihovnou budeme opět muset vložit odpovídající hlavičkový soubor: #include <SDL2/SDL_ttf.h> a dále také zavolat inicializační funkci TTF_Init , kterou bychom měli zavolat v programu někdy po zavolání funkce SDL_Init : SDL_Init(SDL_INIT_VIDEO);
TTF_Init(); Abychom mohli při vykreslování znaků používat průhlednost, a aby byly vykreslované obrázky jednotlivých znaků pěknější, je vhodné na kreslítku (SDL_Renderer) zapnout takzvaný Alpha blending, a také povolit lineární vzorkování pixelů. Na začátek programu (těsně po vytvoření kreslítka) si tedy přidejte tyto dva řádky: SDL_SetRenderDrawBlendMode(renderer, SDL_BLENDMODE_BLEND);
SDL_SetHint(SDL_HINT_RENDER_SCALE_QUALITY, "1"); Na konci programu bychom poté měli prostředky této knihovny opět uvolnit pomocí zavolání funkce TTF_Quit : TTF_Quit(); Pro vykreslení nějakého textu budeme nejprve potřebovat nějaký (bitmapový) font , ideálně ve formátu TTF. Můžete použít např. tento font nebo si nějaký font stáhnout z internetu. Font určuje, jak budou vypadat jednotlivé znaky textu, který se bude vykreslovat na obrazovku. Jakmile máte připravený soubor s fontem, můžete ho ve svém programu načíst pomocí funkce TTF_OpenFont : TTF_Font* font = TTF_OpenFont("Arial.ttf", 20); První parametr udává cestu k souboru s fontem, druhý parametr udává velikost, ve které se má font načíst. Až s fontem přestaneme pracovat (na konci programu), tak bychom jej měli opět uvolnit: TTF_CloseFont(font); Jakmile máme načtený font, tak můžeme do kreslítka vykreslit nějaký text. Můžeme k tomu využít následující funkci, která vyžaduje kreslítko, načtený font, barvu v podobě struktury SDL_Color , obdélník označující pozici, kam se má text vykreslit, a poté samotný text, který se má vykreslit, ve formě řetězce: void sdl_draw_text(SDL_Renderer* renderer, TTF_Font* font, SDL_Color color, SDL_Rect location, const char* text)
{ // Vykreslení textu se zadaným fontem a barvou do obrázku (surface) SDL_Surface* surface = TTF_RenderText_Blended(font, text, color); // Převod surface na hardwarovou texturu SDL_Texture* texture = SDL_CreateTextureFromSurface(renderer, surface); // Vykreslení obrázku SDL_RenderCopy(renderer, texture, NULL, &location); // Uvolnění textury a surface SDL_DestroyTexture(texture); SDL_FreeSurface(surface);
} Tato funkce nejprve vytvoří obrázek s vykresleným textem, a poté obrázek vykreslí do kreslítka, stejně jako kdybychom kreslili jakýkoliv jiný obrázek. Tento kód je relativně neefektivní, neboť při každém vykreslení vytváří dva nové obrázky (surface a texture), a poté je hned uvolňuje. Pro jednoduché hry by to však neměl být výkonnostní problém.

294.body:
V kapitole o herní smyčce už jsme si ukázali, jak můžeme číst události operačního systému. Jelikož se čtení událostí výrazně dotýká i vstupu od uživatele, tak si jej zde popíšeme více do detailu. Pro připomenutí, takto můžeme vyčíst všechny události, které nastaly od poslední iterace herní smyčky: SDL_Event event;
while (SDL_PollEvent(&event)) { // Zde můžeme pracovat s proměnnou `event`
} Když se podíváte na dokumentaci struktury SDL_Event , tak tam najdete různé typy událostí, ke kterým může dojít. Abyste zjistili, k jakému typu události došlo, musíte se podívat na atribut type struktury SDL_Event. Tento atribut může nabývat hodnot, které jsou znázorněny v prvním sloupci této tabulky . Jedná se například o následující typy událostí: Žádost o vypnutí aplikace SDL_QUIT Pohnutí myši SDL_MOUSEMOTION Zmáčknutí tlačítka myši SDL_MOUSEBUTTONDOWN Zmáčknutí tlačítka klávesnice SDL_KEYDOWN V programu byste poté měli mít podmínku, kterou zkontrolujete, jestli došlo k události, na kterou chcete zareagovat. Uvnitř podmínky poté můžete přistupovat k atributu struktury SDL_Event, který odpovídá danému typu události. Název tohoto atributu se dozvíte ve třetím sloupci zmíněné tabulky, a datový typ tohoto atributu poté najdete ve druhém sloupci. Pokud by tedy např. došlo k události otočení kolečka myši (SDL_MOUSEWHEEL), tak poté můžete přistoupit k atributu event.wheel, který bude mít typ SDL_MouseWheelEvent , a z tohoto atributu si poté můžete vyčíst dodatečné informace o události: if (event.type == SDL_MOUSEWHEEL) { SDL_MouseWheelEvent wheel_event = event.wheel; printf( "Kolecko mysi se pohnulo o %d vertikalne a %d horizontalne\n", wheel_event.y, wheel_event.x );
} Kromě čtení událostí pomocí smyčky využívající funkce SDL_PollEvent můžeme také pomocí různých SDL funkcí kdykoliv v programu získat současný stav myši či klávesnice. Oba dva přístupy nám přijdou vhod. Například, ve hře se můžeme kdykoliv zeptat, jestli je zrovna zmáčknuté tlačítko myši. Pokud ale budeme chtít zareagovat na pohyb myši, tak spíše budeme chtít dostat upozornění na to, že došlo k pohybu (pomocí čtení událostí), protože pohyb není vyjádřen současným stavem, ale spíše změnou stavu (tedy událostí). Při popisu klávesnice i myši níže si tedy vždy ukážeme oba dva způsoby, jak vstup získat, pomocí událostí i pomocí získání současného stavu.

297.body:
Pokud bychom chtěli získat současný stav pozice a tlačítek myši, můžeme využít funkci SDL_GetMouseState . Ta jako parametry bere ukazatele na čísla (souřadnice x a y), do kterých uloží současnou pozici myši. Souřadnice budou relativní vzhledem k oknu, nad kterým se zrovna myš nachází, což je obvykle to, co chceme. Návratová hodnota této funkce poté obsahuje číslo, jehož jednotlivé bity označují, která tlačítka myši jsou zrovna stisknuta. Stav tlačítek poté můžeme zjistit pomocí makra SDL_BUTTON: int x = 0;
int y = 0;
Uint32 buttons = SDL_GetMouseState(&x, &y);
int left = (buttons & SDL_BUTTON(SDL_BUTTON_LEFT)) != 0;
int right = (buttons & SDL_BUTTON(SDL_BUTTON_RIGHT)) != 0; printf("Mouse is at (%d, %d). Left button: %d, right button: %d\n", x, y, left, right);

299.body:
U klávesnice jsou k dispozici události SDL_KEYDOWN (stisk klávesy) a SDL_KEYUP (uvolnění klávesy). U obou událostí můžete přistoupit k atributu event.key.keysym.sym, který obsahuje hodnotu datového typu SDL_Keycode , která reprezentuje stisknutou klávesu. Seznam možných hodnot kláves, na které můžete reagovat, je k dispozici v třetím sloupci této tabulky . Např. mezerník je reprezentován hodnotou SDLK_SPACE, klávesa a hodnotou SDLK_a a šipka doprava hodnotou SDLK_RIGHT. Zde je ukázka toho, jak můžeme zareagovat na stisk jednotlivých kláves: if (event.type == SDL_KEYDOWN) { SDL_Keycode code = event.key.keysym.sym; if (code == SDLK_SPACE) { printf("Uzivatel stisknul mezernik\n"); } else if (code == SDLK_RIGHT) { printf("Uzivatel stisknul sipku doprava\n"); }
} Reakce na události klávesnice se hodí pro případy, kdy chceme zareagovat na nějakou jednorázovou událost, např. když hráč stiskne klávesu, která způsobuje vystřelení projektilu. Není však vhodné přímo využívat reakce na události klávesnice pro zpracování kláves, které hráč bude typicky "držet", např. šipky pro pohyb postavy. Pokud hráč klávesu bude držet stisknutou, operační systém sice vaší hře bude předávat pravidelně nové události typu SDL_KEYDOWN, nicméně bude to dělat dost pomalu, v řádu jednotek událostí za vteřinu. To by znamenalo, že pokud byste ve své hře přímo vyvolávali např. pohyb hráčovy postavy v reakci na událost stisknutí klávesy, tak by se postava pohybovala trhaně. if (event.type == SDL_KEYDOWN) { // Toto je špatné řešení pohybu! if (event.key.keysym.sym == SDLK_RIGHT) { hrac.pozice.x += 10 * deltaTime; }
} Mnohem lepší řešení je použít následující přístup: Mít v paměti uložený současný stav stisknutých kláves. To můžete udělat buď pomocí funkce na získání stavu klávesnice , nebo si můžete vytvořit proměnné, které si budou pamatovat stav kláves, které vás zajímají, a poté aktualizovat jejich stav při čtení událostí. Pokud obdržíte událost SDL_KEYDOWN, tak nastavíte stav klávesy na stisknuto, pokud obdržíte událost SDL_KEYUP, tak nastavíte stav na uvolněno. V části herní smyčky, kde aktualizujete stav hry, se podíváte, jaký je stav kláves, a podle tohoto stavu uděláte danou akci (např. posunete postavou hráče). Díky tomu se bude pohyb provádět plynule (např. 60 za vteřinu). Zároveň bude také tento pohyb synchronizovaný s pohybem ostatních objektů hry, které nejsou ovládány klávesami. Pokud použijete tento přístup, tak si musíte dát pozor na to, aby se některé akce neopakovaly vícekrát. Například, pokud budete při zmáčknutí klávesy vyvolávat nějakou jednorázovou akci (např. vystřelení projektilu), tak byste měli přidat do hry kontrolu, jestli od posledního vyvolání této akce uběhl dostatečný čas ("cooldown"). I když totiž uživatel zmáčkne klávesu velmi krátce, tak bude klávesa zmáčknutá pravděpodobně alespoň po dobu několika snímků! Pokud bychom tedy nekontrolovali čas od posledního vyvolání akce, tak by se akce provedla opakovaně, což nemusí být žádoucí. Pro počítání času, který ve hře uběhl, můžete použít delta čas , který si stačí v každé iteraci přičítat do nějaké proměnné, která si bude pamatovat, kolik už uběhlo ve hře času.

