Nicméně to samo o sobě nestačí. Co když je totiž pole už plné? V tom případě nesmíme zapsat hodnotu do paměti na indexu pocet, protože bychom zapsali data mimo validní paměť a došlo by tak k paměťové chybě 💣! Pokud tedy dojde k situaci, že už je naše pole plné, tak jej nejprve musíme zvětšit. To můžeme udělat následujícím postupem: Naalokujeme nové, větší pole na haldě. Jakou velikost (kapacitu) zvolit pro nové pole? Pokud bychom zvyšovali velikost o 1, tak budeme muset pole zvětšovat při přidání každého prvku, což by bylo velmi neefektivní. Obvykle se kapacita rostoucích polí zdvojnásobí, díky čehož bude velikost růst exponenciálně a my tak nebudeme muset často velikost zvětšovat. Překopírujeme původní data ze starého pole do nového pole. Uvolníme paměť starého pole. Nastavíme ukazatel (data) na nové pole na haldě. V kódu by to mohlo vypadat např. takto: // Pokud je pole plne
if (pole->pocet == pole->kapacita) { // Zdvojnasobime kapacitu pole->kapacita = pole->kapacita * 2; // Naalokujeme nove pole s dvojnasobnou kapacitou int* nove_pole = (int*) malloc(sizeof(int) * pole->kapacita); // Prekopirujeme hodnoty ze stareho pole do noveho for (int i = 0; i < pole->pocet; i++) { nove_pole[i] = pole->data[i]; } // Uvolnime pamet stareho pole free(pole->data); // Nastavime ukazatel na nove pole pole->data = nove_pole;
} Jelikož je tato funkcionalita v jazyce C relativně často používaná, standardní knihovna C obsahuje funkci realloc , která toto zvětšení pole umí udělat za nás. Kód výše tak lze zjednodušit: if (pole->pocet == pole->kapacita) { pole->kapacita = pole->kapacita * 2; pole->data = (int*) realloc(pole->data, sizeof(int) * pole->kapacita);
} Kompletní kód funkce na přidání prvku do rostoucího pole naleznete níže.

317.body:
Nesmíme samozřejmě zapomenout ani na to po sobě uklidit. Po skončení práce s polem bychom tedy měli jeho paměť smazat: void poleintu_smaz(PoleIntu* pole) { free(pole->data);
} Celý kód dynamicky rostoucího pole intů můžete naleznout zde: Dynamicky rostoucí pole intů typedef struct { // Ukazatel na data na haldě int* data; // Soucasny pocet prvku v poli int pocet; // Pocet prvku, ktery lze v poli maximalne mit. // Maximalni hodnota, ktere muze nabyvat `pocet`. int kapacita;
} PoleIntu; void poleintu_vytvor(PoleIntu* pole, int kapacita) { // Naalokujeme pamet na halde pole->data = (int*) malloc(sizeof(int) * kapacita); // Na zacatku je pole prazdne, takze je pocet prvku 0 pole->pocet = 0; // Kapacita odpovida tomu, kolik je pole schopne udrzet prvku, nez mu dojde misto pole->kapacita = kapacita;
} void poleintu_pridej(PoleIntu* pole, int hodnota) { // Pokud je pole plne if (pole->pocet == pole->kapacita) { // Zdvojnasobime kapacitu pole->kapacita = pole->kapacita * 2; // Naalokujeme nove pole s dvojnasobnou kapacitou a nastavime ukazatel na nove pole pole->data = (int*) realloc(pole->data, sizeof(int) * pole->kapacita); } // Zapiseme novy prvek na index dany soucasnemu poctu prvku pole->data[pole->pocet] = hodnota; // Zvysime pocet prvku o jednicku pole->pocet += 1;
} void poleintu_smaz(PoleIntu* pole) { // Smazeme dynamicke pole free(pole->data);
}

