Pokud se zamyslíme nad tím, proč nemůžeme použít PoleIntu pro libovolný datový typ, je to způsobeno tím, že každý prvek v tomto poli má fixní velikost (sizeof(int), tedy pravděpodobně 4 byty). Do tohoto pole tedy nemůžeme jednoduše ukládat prvky, které mají jinou velikost, což je problém. Abychom tento problém obešli, můžeme vytvořit pole, jehož prvky budou mít také fixní velikost, ale zároveň budou schopny poskytovat přístup k libovolné hodnotě libovolného datového typu. Toho můžeme dosáhnout tak, že do pole nebudeme ukládat přímo hodnoty, které si chceme zapamatovat, ale pouze jejich adresy. Vytvoříme tedy pole ukazatelů! Jelikož nevíme, s jakým datovým typem bude chtít uživatel toto pole použít, tak nezvolíme pro typ ukazatele int* nebo např. float*, ale použijeme datový typ "obecného" ukazatele, který prostě obsahuje adresu, ale neříká, co na dané adrese leží. Tím je typ void*. Strukturu pole bychom tedy mohli upravit takto: typedef struct { void** data; int pocet; int kapacita;
} RostouciPole; Předtím jsme uchovávali ukazatel, v němž byla adresa, na které ležel datový typ int, proto byl typ atributu data int*. Nyní uchováváme ukazatel, v němž bude adrese, na které bude ležet datový typ void*, proto bude typ atributu data void**. V paměti bude tedy pole vypadat cca takto: // Predtim
[5, 8, 6, 4] // Ted 5 ^ 6 | ^
[|,|,|,|] | | | v | 4 | ╰-> 8 Každý prvek pole bude mít fixní velikost (sizeof(void*), tedy pravděpodobně 8 bytů), a bude obsahovat pouze adresu nějakého prvku (libovolného datového typu). Když si tedy pole pamatuje adresy, odkud je vzít? Pokud bychom do pole dávali adresy např. lokálních proměnných, tak pravděpodobně brzy narazíme na problémy: RostouciPole pole;
pole_vytvor(&pole, 10);
for (int i = 0; i < 10; i++) { // Vloz do pole adresu promenne i pole_pridej(&pole, &i);
} Lokální proměnná může zaniknout dříve, než pole. V ten moment bude adresa v poli neplatná a dojde k nedefinovanému chování 💣. V případě výše si ukládáme do pole adresu té stejné proměnné, takže všechny prvky v poli budou mít stejnou hodnotu. I pokud lokální proměnná bude existovat dostatečně dlouho, a budeme do pole ukládat adresy různých proměnných, tak pořád budeme mít problém v tom, že si budeme muset tuto proměnnou ukládat "někde bokem", protože v poli bude pouze její adresa. Tím nevyřešíme náš původní problém s pole rostoucí velikosti, pouze jej přesuneme jinam. Z toho důvodu se nám vyplatí ukládat do pole takové adresy, jejichž životnost bude neomezená, a nebudeme se tak muset starat o to, jestli náhodou nejsou dealokovány moc brzy. Jinak řečeno, můžeme do pole ukládat paměť alokovanou na haldě . Takovéto pole by pak šlo používat např. takto: RostouciPole pole;
pole_vytvor(&pole, 10); for (int i = 0; i < 10; i++) { int* pamet = malloc(sizeof(int)); *pamet = i + 1; pole_pridej(&pole, pamet);
} for (int i = 0; i < 10; i++) { int* pamet = (int*) pole->data[i]; printf("Prvek cislo %d: %d\n", i, *pamet);
} pole_smaz(pole); Při mazání pole bychom neměli zapomenout na uvolnění všech adres, které jsou v něm uloženy: void pole_smaz(RostouciPole* pole) { for (int i = 0; i < pole->pocet; i++) { free(pole->data[i]); } free(pole->data);
} V současné podobě lze funkci pole_vloz špatně použít. Pokud do ní dáme adresu, která nepochází z funkce malloc, tak dojde k nedefinovanému chování při mazání pole. Zkuste navrhnout jinou verzi funkce pole_vloz, která nepůjde použít špatně, a která zajistí, že paměť bude vždy vytvořena na haldě. Můžete (musíte!) pro to změnit signaturu funkce. Typová kontrola U obecného rostoucího pole je třeba dávat si velký pozor na to, že do něj budeme vkládat a poté z něj vybírat stejné datové typy! Tím, že používáme typ void*, tak nás překladač nebude upozorňovat na práci s nekompatibilními datovými typy. Pokud do pole nejprve vložíte adresu intu, a poté se k této adrese budete chovat, jako by to byla adresa např. floatu (float*), tak se váš program nebude chovat správně! Celý kód dynamicky rostoucího pole intů můžete naleznout zde: Dynamicky rostoucí pole adres typedef struct { // Ukazatel na data na haldě void** data; // Soucasny pocet prvku v poli int pocet; // Pocet prvku, ktery lze v poli maximalne mit. // Maximalni hodnota, ktere muze nabyvat `pocet`. int kapacita;
} RostouciPole; void pole_vytvor(RostouciPole* pole, int kapacita) { // Naalokujeme pamet na halde pole->data = (void**) malloc(sizeof(void*) * kapacita); // Na zacatku je pole prazdne, takze je pocet prvku 0 pole->pocet = 0; // Kapacita odpovida tomu, kolik je pole schopne udrzet prvku, nez mu dojde misto pole->kapacita = kapacita;
} void pole_pridej(RostouciPole* pole, void* adresa) { // Pokud je pole plne if (pole->pocet == pole->kapacita) { // Zdvojnasobime kapacitu pole->kapacita = pole->kapacita * 2; // Naalokujeme nove pole s dvojnasobnou kapacitou a nastavime ukazatel na nove pole pole->data = (void**) realloc(pole->data, sizeof(void*) * pole->kapacita); } // Zapiseme novy prvek na index dany soucasnemu poctu prvku pole->data[pole->pocet] = adresa; // Zvysime pocet prvku o jednicku pole->pocet += 1;
} void pole_smaz(RostouciPole* pole) { for (int i = 0; i < pole->pocet; i++) { free(pole->data[i]); } free(pole->data);
}

