Pole ukazatelů je relativně jednoduché na použití, ale má také nevýhody, hlavně co se týče plýtvání pamětí, protože musíme všechny hodnoty alokovat na haldě, a také s tím související neefektivitou. Rostoucí pole můžeme navrhnout ještě jinak, pokud se k němu budeme chovat v podstatě jako k poli bytů, do kterých budeme byte po bytu kopírovat hodnoty, které v něm chceme ukládat. V této variantě bychom si ve struktuře ukládali pole bytů (znaků), a také velikost datového typu, který chceme do pole ukládat. typedef struct { // Pole bytů/znaků char* data; // Velikost datového typu int velikost_prvku; int pocet; int kapacita;
} RostouciPole; Při vkládání nového prvku pak stačí jeho byty nakopírovat do našeho pole, a při získávání prvku zase byty zpět vykopírovat na adresu, kterou poskytne uživatel: void pole_pridej(RostouciPole* pole, void* adresa) { if (pole->pocet == pole->kapacita) { /* zvetseni pole */ } // Vypocteme cilovou adresu, která bude na "indexu" `pocet` * `velikost_prvku` void* cil = pole->data + (pole->pocet * pole->velikost_prvku); // Zapiseme na danou adresu vsechny byty nasi vkladane hodnoty memcpy(cil, adresa, pole->velikost_prvku);
} void pole_vrat(RostouciPole* pole, int index, void* adresa) { // Vypocteme cilovou adresu, která bude na "indexu" `index` * `velikost_prvku` void* zdroj = pole->data + (indexu * pole->velikost_prvku); // Zapiseme na predanou adresu vsechny byty nasi ziskavane hodnoty memcpy(adresa, zdroj, pole->velikost_prvku);
} Aby toto řešení bylo plně korektní, museli bychom implementaci ještě rozšířit tak, aby brala v potaz zarovnání daného datového typu, jinak by se mohlo stát, že bude vložená hodnota v poli ležet na nezarovnané adrese.

