Zde si ukážeme příklad UB způsobeného přístupem mimo validní paměť pole. Na tomto příkladu si můžeme ukázat, že přítomnost UB v našem zdrojovém kódu může způsobit kompletní rozklad programu, a že nemá smysl spekulovat nad tím, jak se program obsahující UB bude nebo nebude chovat. V této funkci dochází k zjišťování, jestli se předaný argument nachází v poli čtyř čísel. V cyklu dochází k UB - naleznete jej? int je_cislo_v_poli(int v) { int table[4] = { 5, 13, 8, 12 }; for (int i = 0; i <= 4; i++) { if (table[i] == v) return 1; } return 0;
} Jedná se o přístup mimo pole, protože podmínka for cyklu je i <= 4, místo i < 4. Pokud uvidíte takovýto kód, může vás napadnout, že při páté iteraci cyklu dojde k přístupu mimo paměť, možná se vyvolá segmentation fault , ale pokud je funkce zavolána např. s argumentem 5, tak vlastně funkce proběhne "normálně". Není tomu tak! Tento program obsahuje UB, takže jej překladač může přeložit, jak se mu zachce. Například může dojít k tomuto: Překladač vidí, že table[4] je UB, tj. k této situaci nikdy nemůže dojít. Tím pádem i nikdy nemůže být 4. Pokud i nikdy nemůže být 4, tak logicky nikdy nemůže být ani 5 (protože jinak by předtím muselo být i=4). Jelikož i nemůže být 5, tak smyčka je nekonečná, a jediný způsob, jak se může uvnitř smyčky funkce ukončit, je provedením return 1;. Tím pádem překladač funkci přeloží takto: int je_cislo_v_poli(int v) { return 1;
} Zdá se vám to moc divoké? Přesně toto udělá překladač GCC, pokud takovouto funkci přeložíte s optimalizacemi. Nicméně, neznamená to, že se takto program musí zachovat vždy. Kdybyste použili jiný překladač, jinou verzi stejného překladače, jiné parametry překladu nebo dokonce program prostě spustili vícekrát, pokaždé by se mohlo stát něco jiného. Nemá cenu řešit, jak se zachová program obsahující UB . Místo toho je nutné UB najít a z kódu odstranit :)

