} Pokud tento program přeložíte s optimalizacemi, tak se celá funkce může zredukovat pouze na: int foo(int a) { return 1;
} Jak je to možné? Čtení neinicializované proměnné je UB, takže překladač klidně může předpokládat, že b bude vždy 6, a tím pádem bude z funkce vždy vrácena jednička. Chybějící return ve funkci, která nevrací void #include <stdio.h> int foo() {}
int bar() { printf("bar\n");
} Zde je UB, protože foo nevrací hodnotu typu int. Když se podíváme, jak překladač může tuto funkci přeložit , tak se např. může stát to, že foo bude na stejné adrese jako bar, takže kdyby někdo zavolal funkci foo, ve skutečnosti se začne provádět funkce bar! Přetečení celého čísla se znaménkem Čísla se znaménkem (např. int) nesmí "přetéct", tj. dostat se přes svou nejvyšší hodnotu. Tato situace je v jazyce C UB. Přístup mimo validní paměť Přístup mimo validní paměť (např. mimo rozsah pole) je klasický příklad UB. Dereference NULL ukazatele Toto je opět klasický příklad UB. Vícenásobné uvolnění dynamické paměti Viz Segmentation fault . Přístup k uvolněné dynamické paměti Viz Segmentation fault .

