Jazyk Brainfuck je velmi jednoduchý esoterický programovací jazyk obsahující pouze osm instrukcí, lineární paměť a adresu aktuální paměťové buňky. Jedna buňka odpovídá jednomu bytu. Instrukce + inkrementuje hodnotu aktuální buňky. Instrukce - dekrementuje hodnotu aktuální buňky. Instrukce > inkrementuje adresu buňky (po inkrementaci ukazujeme na následující buňku). Instrukce < dekrementuje adresu buňky (po dekrementaci ukazujeme na předcházející buňku). Instrukce [ uvozuje začátek cyklu. Cyklus probíhá, dokud hodnota buňky adresované v době vyhodnocování podmínky není nulová (adresovanou buňku můžeme měnit uvnitř cyklu). Instrukce ] představuje konec těla cyklu. Jakmile program narazí na instrukce ], zkontroluje hodnotu v aktuálně adresované paměťové buňce, a buď se vrátí zpět na odpovídající [, nebo je cyklus ukončen a vykonávání programu pokračuje prováděním instrukcí bezprostředně za cyklem. Instrukce , přečte jeden byte ze vstupu a uloží hodnotu do aktuálně adresované buňky. Instrukce . vypíše hodnotu aktuálně adresované buňky jako ASCII znak na standardní výstup. Všechny ostatní znaky jsou ignorovány. Program Hello, World! v jazyce Brainfuck může vypadat například následovně: ++++++++
[ >++++++++<-
]
>++++++++.>++++++++
[ >++++++++++++<-
]
>+++++.+++++++..+++.>++++++++
[ >+++++<-
]
