C je (programovací) jazyk a jako každý jazyk má svá pravidla, která je nutno dodržovat. Například v češtině musíme dodržovat určitá pravidla a zvyklosti, abychom byli schopni výsledný text pochopit. Věty jsme, M y máma, táta a nebo .o dku d! ty z, jsi nedávají smysl, protože obsahují interpunkční znaménka na špatných místech, větné členy jsou ve špatném pořadí a některá slova obsahují mezery na místech, kam nepatří. Stejně tak v jazyce C můžete velmi jednoduše napsat program, kterému překladač nebude rozumět a překlad poté skončí se syntaktickou chybou ( syntax error ). Na syntax C si musíte postupně zvyknout, poté už podobné chyby budete schopni snadno vyřešit. Zde je asi nejkratší možný program v jazyce C : int main() { return 0;
} Tento program nic nedělá, pouze se zapne a poté vypne. V programu je pouze funkce s názvem main. Funkce si popíšeme později, prozatím budeme psát kód vždy uvnitř funkce main, tj. mezi složené závorky { }, na řádky před return 0;. Jednotlivé prvky programu si postupně vysvětlíme v následujících sekcích, prozatím si však všimněte, že bílé znaky ( whitespace ) [1] jsou obvykle překladačem ignorovány. Například int main() { return 0;
} reprezentuje úplně stejný program. Nicméně asi sami uznáte, že pokud bychom s bílými znaky nakládali takto nerozvážně, tak by zdrojový kód byl pro lidi špatně čitelný. Ideální je nastavit si automatické formátování přímo v editoru kódu, abyste nad formátováním vůbec nemuseli přemýšlet. Bílé znaky jsou (neviditelné) znaky, které reprezentují mezery v textu, tj. odřádkování, mezerník, tabulátor atd. Bílé znaky nicméně nejsou ignorovány úplně na všech místech. Později se dozvíme, že například v řetězcích jsou bílé znaky brány jako součást textu. Nemůžeme také rozdělovat mezerami názvy (např. in t nebo ma in) v programu výše by způsobily chybu při překladu).

