Pokud potřebujete vytvořit více proměnných stejného datového typu, můžete použít více názvů oddělených čárkou za datovým typem proměnné. Takto například lze vytvořit tři celočíselné proměnné s názvy x, y a z: int x = 1, y = 2, z = 3; Doporučujeme však tento způsob tvorby více proměnných spíše nepoužívat, aby byl kód přehlednější. Cvičení 🏋 Zkuste napsat program, který vytvoří několik proměnných, přečte a změní jejich hodnoty a pak je vypíše na výstup programu (k výpisu využijte printf, který jsme si již ukázali dříve ). Použijte debugger , abyste se interaktivně za běhu programu podívali, jaké jsou hodnoty jednotlivých proměnných a jak se měni v čase po provedení přiřazení. Více úloh naleznete zde . Kvíz 🤔 Co vypíše následující program? #include <stdio.h> int main() { int a = 5; printf("a\n"); return 0;
} Odpověď Program vypíše znak a, jelikož vše uvnitř uvozovek se bere jako text. Aby program vypsal hodnotu proměnné a, museli bychom použít např. příkaz printf("a=%d\n", a);. Co vypíše následující program? #include <stdio.h> int main() { int a = 5; printf("%d\n", a); a = 8; return 0;
} Odpověď Program vypíše znak 5, protože v době, kdy proměnnou vypisujeme, tak je její hodnota 5. Po vypsání proměnné sice její hodnotu změníme na 8, ale poté už ji nevypíšeme a program skončí. Co vypíše následující program? #include <stdio.h> int main() { int a = 5; a + 1; printf("%d\n", a); return 0;
} Odpověď Program vypíše znak 5. Provedeme sice výraz a + 1, který se vyhodnotí jako 6, ale výsledek tohoto výrazu se "zahodí", nijak tedy neovlivní další chování programu. Abychom změnili hodnotu proměnné a, museli bychom výsledek tohoto výrazu zpět do proměnné uložit: a = a + 1;. Vyzkoušejte si to. Co vypíše následující program? #include <stdio.h> int main() { int a = 5; int b = a; a = 8; printf("%d\n", a); printf("%d\n", b); return 0;
} Odpověď Program vypíše: 8
5 Při definici proměnné b jsme ji inicializovali hodnotou proměnné a. Výraz a se tedy vyhodnotil jako hodnota 5, která byla uložena do proměnné b. Dále však už spolu proměnné nesouvisí, změna hodnoty proměnné a tedy nijak neovlivní hodnotu uloženou v proměnné b. Co vypíše následující program? #include <stdio.h> int main() { printf("%d\n", a); int a = 5; return 0;
} Odpověď Překlad programu skončí s chybou (use of undeclared identifier 'a'), protože se snažíme číst hodnotu proměnné, která na daném řádku zatím nebyla nadefinována. Proměnnou a můžeme začít používat až poté, co ji nadefinujeme, tj. za řádkem int a = 5;. Co vypíše následující program? #include <stdio.h> int main() { a = 5; printf("%d\n", a); return 0;
} Odpověď Překlad programu skončí s chybou (use of undeclared identifier 'a'), protože se snažíme zapsat výraz 5 do proměnné, která neexistuje. Před prvním použitím proměnné ji vždy nejprve musíme nadefinovat: int a = 5;. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; int b = a = 5; printf("%d\n", a); printf("%d\n", b); return 0;
} Odpověď Program vypíše: 5
5 Výraz přiřazení (<promenna> = <vyraz>) se vyhodnotí jako přiřazená hodnota (<vyraz>), a takto vyhodnocený výraz lze dále v programu použít a např. přiřadit do jiné proměnné. Přiřazení se vyhodnotí následovně: int b = a = 5;
// int b = 5; Nicméně jak asi sami uznáte, takovýto zápis je dosti zmatečný a nemusí být na první pohled jasné, jak se takovýto výraz vyhodnotí. Proto výsledek výrazu přiřazení raději dále nepoužívejte a přiřazení vždy používejte na samostatném řádku se středníkem. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; 5 = a + 1; printf("%d\n", a); return 0;
} Odpověď Překlad programu skončí s chybou expression is not assignable. Snažíme se zde uložit hodnotu výrazu a + 1 na nějaké místo v paměti, ale 5 žádné takové místo neoznačuje, 5 je prostě číselný literál s hodnotou 5, který nemůžeme přepsat či změnit. Co vypíše následující program? #include <stdio.h> int main() { int a; printf("%d\n", a + 1); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣, protože čteme hodnotu proměnné, která nebyla inicializována, a její hodnota je tedy nedefinovaná. Nelze tak určit, co tento program provede, překladač jej může přeložit na totální nesmysl. Takovýto program je špatně a nemá smysl zkoumat, co provede, je potřeba jej nejprve opravit tak, že proměnnou a nainicializujeme. Co vypíše následující program? #include <stdio.h> int main() { int a = a + 1; printf("%d\n", a); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣, stejně jako předchozí ukázka. Při inicializaci proměnné a používáme její hodnotu, která ale v té době není definovaná. Je to jako kdybychom napsali int a;
a = a + 1; Co vypíše následující program? #include <stdio.h> int main() { printf("cislo: %d\n"); return 0;
} Odpověď Tento program obsahuje nedefinované chování 💣. Pokud při použití příkazu printf v textu mezi uvozovkami použijeme zástupný znak (%d), musíme za každý takovýto použitý znak předat této funkci také nějaký celočíselný výraz. V opačném případě bude chování programu nedefinované.

