Často v programu chceme provést právě jednu ze dvou (nebo více) alternativ, opět v závislosti na hodnotě nějakého výrazu (podmínky). To sice můžeme provést pomocí několika if příkazů za sebou: if (body > 90) { znamka = 1; }
if (body <= 90 && body > 80) { znamka = 2; }
if (body <= 80 && body > 50) { znamka = 3; }
... Nicméně to může být často dosti "ukecané", protože se musíme v každé podmínce ujistit, že již nebyla splněna předchozí podmínka, jinak by se mohla provést více než jedna alternativa. Jazyk C tak umožňuje přidat k příkazu if další příkaz, který se provede pouze v případě, že podmínka "ifu" není splněna. Takto lze řetězit více podmínek za sebou, kdy v každé následující podmínce víme, že žádná z předchozích nebyla splněna. Dosáhneme toho tak, že za blokem podmínky if použijeme klíčové slovo else ("v opačném případě"): if (<výraz typu bool>) { // blok kódu
} else ... Pokud za blok podmínky if přidáte else, tak se program začne vykonávat za else, pokud výraz podmínky není splněn. Za else pak může následovat: Blok kódu, který se rovnou provede: if (body > 90) { // blok A
} else { // blok B
}
// X Pokud platí body > 90, provede se blok A, pokud ne, tak se provede blok B. V obou případech bude dále program vykonávat kód od bodu X. Další if podmínka, která je opět vyhodnocena. Takovýchto podmínek může následovat libovolný počet: if (body > 90) { // blok A, více než 90 bodů
} else if (body > 80) { // blok B, méně než 91 bodů, ale více než 80 bodů
} else if (body > 70) { // blok C, méně než 81 bodů, ale více než 70 bodů
}
// X Takovéto spojené podmínky se vyhodnocují postupně shora dolů. První podmínka if, jejíž výraz je vyhodnocen jako true, způsobí, že se provede blok této podmínky, a následně program pokračuje za celou spojenou podmínkou (bod X). Na konec spojené podmínky můžete opět vložit klíčové slovo else s blokem bez podmínky. Tento blok se provede pouze, pokud žádná z předchozích podmínek není splněna: if (body > 90) { // blok A, více než 90 bodů
} else if (body > 80) { // blok B, méně než 90 bodů, ale více než 80 bodů
} else { // blok C, méně než 81 bodů
} Všimněte si, že tento kód opět můžeme přečíst jako intuitivní větu. Pokud je počet bodů vyšší, než 90, tak proveď A. V opačném případě, pokud je vyšší než 80, tak proveď B. Jinak proveď C. Cvičení 🏋 Upravte následující program, aby vypsal: Student uspel s vyznamenanim, pokud je hodnota proměnné body větší než 90. Student uspel, pokud je hodnota proměnné body v (uzavřeném) intervalu [51, 90]. Student neuspel, pokud je hodnota proměnné body menší než 51. #include <stdio.h> int main() { int body = 50; printf("Student uspel\n"); return 0;
}

