"); } return 0;
} Odpověď Program vypíše: a >= 2
a >= 1 Všimněte si, že před posledním příkazem if není else! To znamená, že se jedná o nezávislý příkaz if, který nijak nesouvisí s prvním příkazem if nad ním. Kvůli toho se tento příkaz provede, i když byl předtím proveden blok za podmínkou else if (a >= 2). V běžném programu by byl tento kód formátován spíše následovně: int a = 2;
if (a >= 3) { printf("a >= 3
");
} else if (a >= 2) { printf("a >= 2
");
} if (a >= 1) { printf("a >= 1
");
} S tímto formátováním je mnohem jednodušší rozpoznat, že spolu tyto dva příkazy if nesouvisí. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; int b = 4; if (a > 1) { if (b == 4) { printf("b == 4
"); } else { printf("b != 4
"); } } return 0;
} Odpověď Tento program nevypíše nic. Podmínka a > 1 se vyhodnotí jako false, takže blok kódu za touto podmínkou se vůbec nevykoná. Co vypíše následující program? #include <stdio.h> int main() { int a = 1; if (a = 2) { printf("a se rovna dvoum
"); } return 0;
} Odpověď Tento program vypíše a se rovna dvoum. Pozor na to, že operátor přiřazení [x] = [y] přiřadí výraz [y] do [x], a vyhodnotí se jako hodnota [y]. V tomto případě se tedy do proměnné a uloží hodnota 2, a jelikož 2 se po převodu na bool vyhodnotí jako pravda (true), se tělo příkazu if provede. Záměna přiřazení (=) a == (porovnání) je častou začátečnickou chybou .

99.body:
🤓 Tato sekce obsahuje doplňující učivo. Pokud je toho na vás moc, můžete ji prozatím přeskočit a vrátit se k ní později. V případě, že byste chtěli provést rozlišný kód v závislosti na hodnotě nějakého výrazu, a tento výraz (např. hodnota proměnné) může nabývat většího množství různých hodnot, tak může být zdlouhavé použít spoustu ifů: if (a == 0) { ...
}
else if (a == 1) { ...
}
else if (a == 2) { ...
}
... Jako jistá zkratka může sloužit příkaz switch. Ten má následující syntaxi: switch (<výraz>) { case <hodnota A>: <blok kódu> case <hodnota B>: <blok kódu> case <hodnota C>: <blok kódu> ...
} Tento příkaz vyhodnotí výraz v závorce za klíčovým slovem switch. Pokud se v bloku kódu za závorkou nachází klíčové slovo case následované hodnotou odpovídající hodnotě výrazu, tak program začne vykonávat blok kódu, který následuje za tímto case. Dále se program bude vykonávat sekvenčně až do bloku switche (při tomto vykonávání už se klíčová slovo case i hodnoty za ním ignorují) [1] . Toto chování se anglicky označuje jako fallthrough . Tento program vypíše 52, protože předaný výraz má hodnotu 5, takže program skočí na blok za case 5 a dále pokračuje sekvenčně až do konce bloku switch příkazu. #include <stdio.h> int main() { switch (5) { case 0: printf("0"); case 1: printf("1"); case 5: printf("5"); case 2: printf("2"); } return 0;
}
